	VALUES (0, 'Jonathan_Joestar', 'Jonathan_Joestar@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Jonathan Joestar', 'Jonathan Joestar (ジョナサン・ジョースター, Jonasan Jōsutā) is the main protagonist of the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, and the first JoJo of the series. His legacy extends throughout almost the entirety of the first six parts of the series, with major characters such as Joseph Joestar and Jotaro Kujo being his descendants.', TIMESTAMP WITH TIME ZONE '2020-01-21 16:12:12+00', 53.78::money, TRUE);
	VALUES (1, 'Will_Anthonio_Zeppeli', 'Will_Anthonio_Zeppeli@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Will Anthonio Zeppeli', 'Will Anthonio Zeppeli (ウィル・Ａ(アントニオ)・ツェペリ, Wiru Antonio Tseperi), also known as Baron Zeppeli (ツェペリ男爵, Tseperi Danshaku), is a primary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood.', TIMESTAMP WITH TIME ZONE '2018-09-23 02:43:22+00', 0.00::money, TRUE);
	VALUES (2, 'Robert_E._O._Speedwagon', 'Robert_E._O._Speedwagon@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Robert E. O. Speedwagon', 'Robert E. O. Speedwagon (ロバート・E・O・スピードワゴン, Robāto Ī Ō Supīdowagon) is a primary ally featured in the 1st part of the JoJo''s Bizarre Adventure series, Phantom Blood. Formerly a Londoner thug residing in Ogre Street, Speedwagon befriends Jonathan Joestar and becomes a loyal ally to his cause.', TIMESTAMP WITH TIME ZONE '2018-02-27 17:24:48+00', 285.82::money, FALSE);
	VALUES (3, 'Erina_Pendleton', 'Erina_Pendleton@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Erina Pendleton', 'Erina Pendleton (エリナ・ペンドルトン, Erina Pendoruton) is a secondary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, as well as the second part, Battle Tendency.', TIMESTAMP WITH TIME ZONE '2020-03-18 19:30:33+00', 236.75::money, TRUE);
	VALUES (4, 'Poco', 'Poco@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Poco', 'Poco (ポコ,, Poko) is a secondary ally featured in the first part of the JoJo''s Bizarre Adventure series,  Phantom Blood.', TIMESTAMP WITH TIME ZONE '2021-01-16 06:24:59+00', 0.00::money, FALSE);
