	VALUES (6, 'Tonpetty', 'Tonpetty@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Tonpetty', 'Tonpetty (トンペティ, Tonpeti) is a tertiary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood. He is a Ripple master who trained Will Anthonio Zeppeli, later joining forces with Jonathan directly alongside his disciples Straizo and Dire.', TIMESTAMP WITH TIME ZONE '2018-04-20 11:54:57+00', 0.00::money, FALSE);
	VALUES (7, 'Straizo', 'Straizo@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Straizo', 'Straizo (ストレイツォ, Sutoreitso) is tertiary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, and a secondary antagonist in the second part, Battle Tendency. ', TIMESTAMP WITH TIME ZONE '2020-04-11 08:14:53+00', 360.59::money, TRUE);
	VALUES (8, 'Dire', 'Dire@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Dire', 'Dire (ダイアー, Daiā) is a tertiary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood. ', TIMESTAMP WITH TIME ZONE '2019-05-09 06:45:25+00', 0.00::money, TRUE);
	VALUES (9, 'Dio_Brando', 'Dio_Brando@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Dio Brando', 'Dio Brando (ディオ・ブランドー, Dio Burandō), later known simply as DIO (ＤＩＯ(ディオ)), is the main antagonist of the first and third parts of the JoJo''s Bizarre Adventure series, Phantom Blood and Stardust Crusaders, as well as a posthumous primary antagonist in the sixth part, Stone Ocean. His influence is felt throughout all of the first six parts of the series, with major characters such as Giorno Giovanna and Enrico Pucci being directly connected to him.', TIMESTAMP WITH TIME ZONE '2020-03-05 21:15:10+00', 182.03::money, FALSE);
