Joseph Joestar (ジョセフ・ジョースター, Josefu Jōsutā) is the main protagonist of the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, and the second JoJo of the series. He also appears as a primary ally in Stardust Crusaders, and a secondary ally in Diamond is Unbreakable.', TIMESTAMP WITH TIME ZONE '2020-01-25 03:51:23+00', 13.08::money, TRUE);
	VALUES (53, 'Caesar_Anthonio_Zeppeli', 'Caesar_Anthonio_Zeppeli@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Caesar Anthonio Zeppeli', 'Caesar Anthonio Zeppeli (シーザー・アントニオ・ツェペリ, Shīzā Antonio Tseperi) is a primary ally featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency.', TIMESTAMP WITH TIME ZONE '2020-04-25 08:13:03+00', 0.00::money, TRUE);
	VALUES (54, 'Lisa_Lisa', 'Lisa_Lisa@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Lisa Lisa', 'Lisa Lisa (リサリサ, Risa Risa), full name Elizabeth Joestar (エリザベス・ジョースター, Erizabesu Jōsutā), is a primary ally featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, but introduced in the first part, Phantom Blood.', TIMESTAMP WITH TIME ZONE '2018-11-22 06:43:38+00', 284.52::money, TRUE);
	VALUES (55, 'Rudol_von_Stroheim', 'Rudol_von_Stroheim@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Rudol von Stroheim', 'Rudol von Stroheim (ルドル・フォン・シュトロハイム, Rudoru fon Shutorohaimu) is a primary ally featured in the 2nd part of JoJo''s Bizarre Adventure, Battle Tendency.', TIMESTAMP WITH TIME ZONE '2020-09-02 17:27:26+00', 0.00::money, TRUE);
	VALUES (56, 'Messina', 'Messina@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Messina', 'Messina (メッシーナ, Messhīna) is a minor ally featured in the second part of JoJo''s Bizarre Adventure, Battle Tendency. As Lisa Lisa''s servants and Ripple masters, he and Loggins train Joseph and Caesar Anthonio Zeppeli in the ways of the Ripple.', TIMESTAMP WITH TIME ZONE '2020-10-26 19:38:50+00', 333.12::money, TRUE);
	VALUES (57, 'Loggins', 'Loggins@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Loggins', 'Loggins (ロギンズ, Roginzu) is a minor ally featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency. As one of Lisa Lisa''s servants and a fellow Ripple master, he personally trains Joseph after his first encounter with the Pillar Men.', TIMESTAMP WITH TIME ZONE '2021-04-03 18:13:58+00', 163.38::money, TRUE);
	VALUES (58, 'Smokey_Brown', 'Smokey_Brown@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Smokey Brown', 'Smokey Brown (スモーキー・ブラウン Sumōkī Buraun) is a minor ally featured in the 2nd part of JoJo''s Bizarre Adventure, Battle Tendency. ', TIMESTAMP WITH TIME ZONE '2020-04-28 10:51:47+00', 138.34::money, TRUE);
	VALUES (59, 'Suzi_Q', 'Suzi_Q@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Suzi Q', 'Suzi Q (スージーQ, Sūjīkyū), later known as Suzi Q Joestar (スージーQ・ジョースター, Sūjīkyū Jōsutā), is a minor character featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, and then the third part, Stardust Crusaders. She is Lisa Lisa''s servant, but a powerless human. Suzi Q becomes Joseph Joestar''s love interest and later wife.', TIMESTAMP WITH TIME ZONE '2020-10-27 08:11:01+00', 6.26::money, FALSE);
	VALUES (60, 'Kars', 'Kars@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Kars', 'Kars (カーズ, Kāzu) is the main antagonist of the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, and the second main antagonist of the series.', TIMESTAMP WITH TIME ZONE '2018-02-22 16:07:05+00', 80.85::money, TRUE);
