	VALUES (224, 'Josuke_Higashikata', 'Josuke_Higashikata@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Josuke Higashikata', '
Josuke Higashikata (東方 仗助, Higashikata Jōsuke) is the main protagonist of the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable, and the fourth JoJo of the series. He is the illegitimate son of Joseph Joestar and Tomoko Higashikata.', TIMESTAMP WITH TIME ZONE '2021-01-18 14:17:56+00', 335.95::money, TRUE);
	VALUES (225, 'Okuyasu_Nijimura', 'Okuyasu_Nijimura@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Okuyasu Nijimura', 'Okuyasu Nijimura (虹村 億泰, Nijimura Okuyasu) is a main ally featured in the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable.', TIMESTAMP WITH TIME ZONE '2020-12-09 10:27:21+00', 0.00::money, TRUE);
	VALUES (226, 'Koichi_Hirose', 'Koichi_Hirose@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Koichi Hirose', 'Koichi Hirose (広瀬 康一, Hirose Kōichi) is the deuteragonist of the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable. He also appears briefly as a minor ally in the fifth part, Vento Aureo, assisting Giorno Giovanna in the fight against Polpo''s Stand, Black Sabbath.', TIMESTAMP WITH TIME ZONE '2019-09-21 11:52:06+00', 336.25::money, FALSE);
	VALUES (227, 'Rohan_Kishibe', 'Rohan_Kishibe@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Rohan Kishibe', '
Rohan Kishibe (岸辺 露伴, Kishibe Rohan) is a main ally featured in the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable. First featured as an antagonist in the "Let''s Go to the Manga Artist''s House" story arc, he cooperates in the search for Yoshikage Kira.', TIMESTAMP WITH TIME ZONE '2018-10-12 22:09:55+00', 26.33::money, TRUE);
	VALUES (228, 'Hayato_Kawajiri', 'Hayato_Kawajiri@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Hayato Kawajiri', 'Hayato Kawajiri (川尻 早人, Kawajiri Hayato) is a major ally featured in the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, playing a crucial role in the "My Dad Is Not My Dad" and "Crazy Diamond is Unbreakable story arcs.', TIMESTAMP WITH TIME ZONE '2020-01-16 01:33:17+00', 90.43::money, TRUE);
	VALUES (229, 'Reimi_Sugimoto', 'Reimi_Sugimoto@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Reimi Sugimoto', 'Reimi Sugimoto (杉本 鈴美, Sugimoto Reimi) is a major ally featured in the 4th part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, introduced in the "Rohan Kishibe''s Adventure" story arc.', TIMESTAMP WITH TIME ZONE '2021-02-13 22:38:50+00', 188.08::money, TRUE);
	VALUES (230, 'Shigekiyo_Yangu', 'Shigekiyo_Yangu@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Shigekiyo Yangu', '
Shigekiyo Yangu (矢安宮 重清, Yangū Shigekiyo), nicknamed Shigechi (重ちー, Shigechī), is a side character featured in the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, specifically in the "''Shigechi''s'' Harvest" and "Yoshikage Kira Just Wants to Live Quietly" story arcs.', TIMESTAMP WITH TIME ZONE '2019-03-30 04:30:12+00', 239.20::money, TRUE);
