	VALUES (373, 'Ermes_Costello', 'Ermes_Costello@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Ermes Costello', '
Ermes Costello (エルメェス・コステロ, Erumēsu Kosutero), is a major ally featured in the sixth part of JoJo''s Bizarre Adventure, Stone Ocean.
Ermes is a woman voluntarily imprisoned in Green Dolphin Street Prison in order to seek revenge for her sister Gloria Costello''s killer, Sports Maxx, and soon allies herself with Jolyne Cujoh in the hostile environment that the jail is. Thanks to a certain pendant, Ermes acquires her own Stand, Kiss.', TIMESTAMP WITH TIME ZONE '2018-08-13 20:36:34+00', 317.33::money, FALSE);
	VALUES (374, 'Emporio_Alnino', 'Emporio_Alnino@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Emporio Alnino', 'Emporio Alnino (エンポリオ・アルニーニョ, Enporio Arunīnyo) is a major ally featured in the sixth part of JoJo''s Bizarre Adventure, Stone Ocean.', TIMESTAMP WITH TIME ZONE '2018-07-02 12:30:34+00', 73.23::money, TRUE);
