Norisuke Higashikata IV (四代目東方 憲助, Yondaime Higashikata Norisuke), born Josuke Higashikata (東方常助, Higashikata Jōsuke), is an ally featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion.', TIMESTAMP WITH TIME ZONE '2020-01-08 16:47:43+00', 382.81::money, TRUE);
	VALUES (571, 'Jobin_Higashikata', 'Jobin_Higashikata@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Jobin Higashikata', 'Jobin Higashikata (東方 常敏, Higashikata Jōbin) is a primary antagonist featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion.', TIMESTAMP WITH TIME ZONE '2021-02-07 16:28:45+00', 362.52::money, FALSE);
	VALUES (572, 'Mitsuba_Higashikata', 'Mitsuba_Higashikata@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Mitsuba Higashikata', 'Mitsuba Higashikata (東方 密葉, Higashikata Mitsuba) is a secondary character featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion. Gaining significance during the "Doctor Wu and Awaking 3 Leaves" story arc, she becomes a temporary ally to Yasuho Hirose.', TIMESTAMP WITH TIME ZONE '2021-03-23 04:12:30+00', 0.00::money, TRUE);
	VALUES (573, 'Tsurugi_Higashikata', 'Tsurugi_Higashikata@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Tsurugi Higashikata', 'Tsurugi Higashikata (東方 つるぎ, Higashikata Tsurugi) is a side character featured in the 8th part of JoJo''s Bizarre Adventure, JoJolion. Tsurugi cooperates with different factions during the course of the story.', TIMESTAMP WITH TIME ZONE '2020-09-26 03:08:11+00', 373.78::money, TRUE);
	VALUES (574, 'Joshu_Higashikata', 'Joshu_Higashikata@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Joshu Higashikata', 'Joshu Higashikata (東方 常秀, Higashikata Jōshū) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion.', TIMESTAMP WITH TIME ZONE '2018-08-08 22:47:37+00', 0.00::money, TRUE);
	VALUES (575, 'Hato_Higashikata', 'Hato_Higashikata@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Hato Higashikata', 'Hato Higashikata (東方 鳩, Higashikata Hato) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Introduced early in the story, she gains significance in the "Hato Brought Her Boyfriend Home" story arc and becomes a temporary ally in Walking Heart.', TIMESTAMP WITH TIME ZONE '2018-11-13 23:51:02+00', 136.17::money, FALSE);
	VALUES (576, 'Daiya_Higashikata', 'Daiya_Higashikata@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Daiya Higashikata', '
Daiya Higashikata (東方 大弥, Higashikata Daiya) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Introduced as an antagonist in the "California King Bed" story arc, Daiya becomes a neutral character in subsequent arcs.', TIMESTAMP WITH TIME ZONE '2019-05-26 20:47:12+00', 87.20::money, TRUE);
	VALUES (577, 'Kaato_Higashikata', 'Kaato_Higashikata@jojo.com', '$2b$12$YdzAWuBFZGOGd0SFaiAJlecC3a0u7o6igXBiZCdaR0bNenOl6asJe', 'Kaato Higashikata', 'Kaato Higashikata (東方 花都, Higashikata Kāto) is a tertiary character featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion.', TIMESTAMP WITH TIME ZONE '2019-06-23 21:04:59+00', 399.97::money, TRUE);
