	VALUES (373, 662, TIMESTAMP WITH TIME ZONE '2020-09-18 04:41:15+00', 'E por mais namorar o soberano
');
	VALUES (373, 662, TIMESTAMP WITH TIME ZONE '2020-09-18 05:35:26+00', 'Às aves variadas, que ali saltam,
