	VALUES (377, 393, TIMESTAMP WITH TIME ZONE '2020-08-04 02:57:43+00', 'Se assenta o Rei Inglês com toda a corte:
');
	VALUES (377, 393, TIMESTAMP WITH TIME ZONE '2020-08-04 06:55:55+00', 'Se entre vós a verdade não se nega,
