	VALUES (380, 396, TIMESTAMP WITH TIME ZONE '2020-04-11 11:24:10+00', '"Dos cavalos o estrépito parece
');

	VALUES (381, 579, TIMESTAMP WITH TIME ZONE '2019-01-22 04:37:06+00', 'Mole se fez e fraco; e bem parece,
');
	VALUES (381, 396, TIMESTAMP WITH TIME ZONE '2019-01-22 05:03:33+00', 'Os olhos encovados, e a postura
');
