	VALUES (422, 451, TIMESTAMP WITH TIME ZONE '2021-06-11 12:44:11+00', 'Os marinheiros duma e doutra banda;
');

	VALUES (423, 460, TIMESTAMP WITH TIME ZONE '2021-04-02 18:14:42+00', 'E como é fora delas se endurece.
