	VALUES (423, 460, TIMESTAMP WITH TIME ZONE '2021-04-03 02:26:29+00', 'Porque a sombra de Aquiles a condena,
');

	VALUES (424, 612, TIMESTAMP WITH TIME ZONE '2018-10-07 10:46:50+00', 'A vida em salvo escapa por acerto.
');
	VALUES (424, 612, TIMESTAMP WITH TIME ZONE '2018-10-07 13:20:45+00', 'Da terra que outro povo não pisou;
');
	VALUES (424, 452, TIMESTAMP WITH TIME ZONE '2018-10-07 20:45:52+00', 'Em versos divulgado numerosos.
');
	VALUES (424, 452, TIMESTAMP WITH TIME ZONE '2018-10-08 00:51:10+00', 'Perde a virtude contra tanta gente.
');

	VALUES (425, 453, TIMESTAMP WITH TIME ZONE '2019-12-17 14:51:48+00', 'Navegação, os vários céus e gentes;
');
	VALUES (425, 453, TIMESTAMP WITH TIME ZONE '2019-12-17 16:12:02+00', 'Noutra parte esculpida estava a guerra,
');

	VALUES (426, 671, TIMESTAMP WITH TIME ZONE '2020-03-28 13:27:11+00', 'Com que Ceilão é rica, ilustre e bela.
');
	VALUES (426, 671, TIMESTAMP WITH TIME ZONE '2020-03-28 13:59:39+00', '"Da terra dos Algarves, que lhe fora
');
	VALUES (426, 453, TIMESTAMP WITH TIME ZONE '2020-03-28 21:18:04+00', 'Para que tu recíproco respondas,
');
	VALUES (426, 671, TIMESTAMP WITH TIME ZONE '2020-03-28 22:17:32+00', 'Que louvor tão suspeito mal me esteja;
');

	VALUES (427, 689, TIMESTAMP WITH TIME ZONE '2020-05-10 21:07:15+00', 'Um Pacheco fortíssimo, e os temidos
');
	VALUES (427, 454, TIMESTAMP WITH TIME ZONE '2020-05-10 23:30:03+00', 'Negros chuveiros, noites tenebrosas,
');

	VALUES (428, 667, TIMESTAMP WITH TIME ZONE '2019-11-26 04:18:43+00', 'Cada um as vergonhosas partes cinge.
');
	VALUES (428, 454, TIMESTAMP WITH TIME ZONE '2019-11-26 11:07:14+00', 'Aqueles que nos Reinos lá da Aurora
');
	VALUES (428, 454, TIMESTAMP WITH TIME ZONE '2019-11-26 11:46:55+00', 'De pescados criando vários modos,
');

	VALUES (429, 559, TIMESTAMP WITH TIME ZONE '2020-04-14 08:41:28+00', '"Esse que bebeu tanto da água Aónia,
