');

	VALUES (433, 657, TIMESTAMP WITH TIME ZONE '2021-03-01 19:15:03+00', 'Isto feito, se parte diligente
');
	VALUES (433, 657, TIMESTAMP WITH TIME ZONE '2021-03-01 20:06:19+00', 'É ele pera dar-te um Reino rico.
');

	VALUES (434, 460, TIMESTAMP WITH TIME ZONE '2021-04-04 16:05:38+00', 'Que a virtude louvada vive e cresce,
