');

	VALUES (439, 596, TIMESTAMP WITH TIME ZONE '2018-09-06 06:53:57+00', 'Dos povos de Mombaça pouco humanos.
');
	VALUES (439, 465, TIMESTAMP WITH TIME ZONE '2018-09-06 11:53:47+00', 'Um Português mandado logo parte
');
	VALUES (439, 596, TIMESTAMP WITH TIME ZONE '2018-09-06 17:30:59+00', 'Por entre pedras alvas se deriva
');

	VALUES (440, 519, TIMESTAMP WITH TIME ZONE '2019-09-15 12:01:05+00', 'Que nos Reinos Gangéticos faleça;
