	VALUES (441, 643, TIMESTAMP WITH TIME ZONE '2020-03-29 23:17:49+00', 'Que em lança de aço torna o Bago de ouro.
');
	VALUES (441, 643, TIMESTAMP WITH TIME ZONE '2020-03-29 23:34:10+00', 'Vá sem perigo a frota, não temendo,
');
	VALUES (441, 643, TIMESTAMP WITH TIME ZONE '2020-03-30 03:58:59+00', 'Antes que esteis mais perto do perigo."
');

	VALUES (442, 510, TIMESTAMP WITH TIME ZONE '2021-01-08 07:00:23+00', 'Era para favor dos Lusitanos
');

	VALUES (443, 534, TIMESTAMP WITH TIME ZONE '2019-06-10 23:20:06+00', 'A barba hirsuta, intonsa, mas comprida.
');

	VALUES (444, 468, TIMESTAMP WITH TIME ZONE '2019-11-05 23:24:53+00', 'De iguarias suaves e divinas,
');

	VALUES (445, 468, TIMESTAMP WITH TIME ZONE '2020-08-17 09:58:02+00', 'Mas comer o Gentio não pretende,
');

	VALUES (446, 604, TIMESTAMP WITH TIME ZONE '2019-12-14 22:57:18+00', '"Olha: por seu conselho e ousadia
');
	VALUES (446, 604, TIMESTAMP WITH TIME ZONE '2019-12-15 03:04:52+00', 'Não eram ancorados, quando a gente
');
