	VALUES (448, 471, TIMESTAMP WITH TIME ZONE '2019-01-05 07:13:59+00', 'Busco as terras da índia tão famosa.
');
	VALUES (448, 695, TIMESTAMP WITH TIME ZONE '2019-01-05 10:44:56+00', 'Dos ventos, ou das águas sem corrente,
');

	VALUES (449, 602, TIMESTAMP WITH TIME ZONE '2020-10-04 10:32:52+00', 'Se fazem conhecer perpetuamente
');
	VALUES (449, 602, TIMESTAMP WITH TIME ZONE '2020-10-04 16:52:48+00', 'Vencidos e em miséria extrema postos;
');
	VALUES (449, 471, TIMESTAMP WITH TIME ZONE '2020-10-04 17:30:03+00', 'Que, quando ao medo infame não se rende,
');

	VALUES (450, 472, TIMESTAMP WITH TIME ZONE '2019-05-11 03:38:05+00', 'Cheios de terra e crespos os cabelos,
');
	VALUES (450, 472, TIMESTAMP WITH TIME ZONE '2019-05-11 09:53:46+00', 'Tão lento e sojugado a duro freio,
');

	VALUES (451, 498, TIMESTAMP WITH TIME ZONE '2020-05-03 01:02:16+00', '"Vereis a terra, que a água lhe tolhia,
');

	VALUES (452, 591, TIMESTAMP WITH TIME ZONE '2019-12-07 18:52:33+00', 'Também deixo a memória, que os obriga
