	VALUES (452, 474, TIMESTAMP WITH TIME ZONE '2019-12-07 20:58:51+00', 'Dos infiéis, formosa companhia
');

	VALUES (453, 475, TIMESTAMP WITH TIME ZONE '2020-05-24 11:52:42+00', 'Da potência real, soberba e rica.
');
	VALUES (453, 475, TIMESTAMP WITH TIME ZONE '2020-05-24 14:43:54+00', 'As que o Rei manda aos nobres cavaleiros,
');

	VALUES (454, 660, TIMESTAMP WITH TIME ZONE '2021-01-05 09:43:29+00', 'Recrescem os amigos sobre a pouca
