	VALUES (455, 476, TIMESTAMP WITH TIME ZONE '2018-09-21 20:11:04+00', 'Este, pelo seu povo injuriado,
');
	VALUES (455, 476, TIMESTAMP WITH TIME ZONE '2018-09-22 03:51:17+00', 'De experiência em armas e furor.
');
	VALUES (455, 476, TIMESTAMP WITH TIME ZONE '2018-09-22 05:51:47+00', 'Mas há-se de sofrer que o fado desse
');
	VALUES (455, 628, TIMESTAMP WITH TIME ZONE '2018-09-22 13:19:26+00', 'A Bóreas, que do peito mais queria,
');

	VALUES (456, 528, TIMESTAMP WITH TIME ZONE '2019-09-01 13:49:52+00', 'Que não o empregue em quem o não mereça,
