	VALUES (457, 692, TIMESTAMP WITH TIME ZONE '2018-07-20 11:26:36+00', 'O carro alto do pai, nem o ar vazio
');
	VALUES (457, 692, TIMESTAMP WITH TIME ZONE '2018-07-20 16:03:44+00', 'Para que ao grande Príncipe o apresente,
');

	VALUES (458, 521, TIMESTAMP WITH TIME ZONE '2020-02-26 04:46:07+00', 'Estarão prometendo a seu senhor;
