');
	VALUES (482, 500, TIMESTAMP WITH TIME ZONE '2020-07-19 08:08:56+00', '"Ó tu, que só tiveste piedade,
');

	VALUES (483, 501, TIMESTAMP WITH TIME ZONE '2018-10-28 16:26:37+00', 'Entre as gentes deixar de si memória
');
	VALUES (483, 694, TIMESTAMP WITH TIME ZONE '2018-10-28 17:55:41+00', 'Nos campos de Tarifa estão defronte
');

	VALUES (484, 501, TIMESTAMP WITH TIME ZONE '2018-11-07 05:13:51+00', 'Corpo certo me tem maravilhado.--
