	VALUES (495, 577, TIMESTAMP WITH TIME ZONE '2019-07-21 00:33:07+00', 'Com lustrosa e lograda companhia.
');
	VALUES (495, 511, TIMESTAMP WITH TIME ZONE '2019-07-21 06:51:51+00', 'Em grosso a consciência limpa e certa,
');
	VALUES (495, 577, TIMESTAMP WITH TIME ZONE '2019-07-21 09:44:47+00', 'Que se tornem às naus; e por que a fama
');

	VALUES (496, 513, TIMESTAMP WITH TIME ZONE '2019-04-04 05:59:40+00', 'Pelos ebúrneos ombros espalhados:
