	VALUES (497, 515, TIMESTAMP WITH TIME ZONE '2019-08-23 05:35:25+00', 'Em consonância igual, os instumentos
');
	VALUES (497, 675, TIMESTAMP WITH TIME ZONE '2019-08-23 09:14:16+00', '"Olha este desleal o como paga
');
	VALUES (497, 675, TIMESTAMP WITH TIME ZONE '2019-08-23 09:48:28+00', 'Não por tomar a terra que era sua.
');

	VALUES (498, 520, TIMESTAMP WITH TIME ZONE '2021-03-01 14:10:11+00', 'E mais que um largo masto se engrossava;
');
	VALUES (498, 520, TIMESTAMP WITH TIME ZONE '2021-03-01 15:08:35+00', 'Manda logo os feitores Lusitanos
');
	VALUES (498, 517, TIMESTAMP WITH TIME ZONE '2021-03-01 19:24:01+00', 'Que o bom Religioso verdadeiro
');
	VALUES (498, 517, TIMESTAMP WITH TIME ZONE '2021-03-02 01:13:00+00', 'Não há também Virgílios nem Homeros;
');

	VALUES (499, 564, TIMESTAMP WITH TIME ZONE '2021-02-17 22:40:23+00', 'Os Reis da índia, livres e seguros,
');
	VALUES (499, 564, TIMESTAMP WITH TIME ZONE '2021-02-17 23:40:26+00', 'C''um delgado sendal as partes cobre,
');
	VALUES (499, 564, TIMESTAMP WITH TIME ZONE '2021-02-18 03:20:16+00', 'Nos duros corações da plebe rude;
');

	VALUES (500, 524, TIMESTAMP WITH TIME ZONE '2020-07-17 06:39:45+00', 'Vai a linda Dione furiosa;
');
	VALUES (500, 524, TIMESTAMP WITH TIME ZONE '2020-07-17 10:57:36+00', 'Acabe-se esta luz ali comigo.
');
	VALUES (500, 518, TIMESTAMP WITH TIME ZONE '2020-07-17 11:37:37+00', 'Se dava às flores cor a bela Aurora,
');
	VALUES (500, 518, TIMESTAMP WITH TIME ZONE '2020-07-17 14:38:21+00', 'Vencidos vêm do sono, e mal despertos;
');

	VALUES (501, 545, TIMESTAMP WITH TIME ZONE '2020-03-22 21:25:31+00', 'Aquelas, que o comércio lhe tomavam,
');
	VALUES (501, 521, TIMESTAMP WITH TIME ZONE '2020-03-23 03:12:25+00', 'Altamente lhe dói perder a glória,
');

	VALUES (502, 627, TIMESTAMP WITH TIME ZONE '2020-12-18 07:01:17+00', 'Que fácil é a verdade de entender-se."
');
	VALUES (502, 521, TIMESTAMP WITH TIME ZONE '2020-12-18 14:32:44+00', 'Que não se arme, e se indigne o Céu sereno
');
	VALUES (502, 627, TIMESTAMP WITH TIME ZONE '2020-12-18 21:33:19+00', '"Um grande Rei, de lá das partes Onde
');
	VALUES (502, 521, TIMESTAMP WITH TIME ZONE '2020-12-19 04:02:24+00', '"E se queres com pactos e alianças
');

	VALUES (503, 536, TIMESTAMP WITH TIME ZONE '2020-03-18 15:58:36+00', 'Co''o senhorio de ínclitos Hispanos.
');
	VALUES (503, 522, TIMESTAMP WITH TIME ZONE '2020-03-18 20:40:28+00', 'Nalgum porto seguro de verdade
');
	VALUES (503, 536, TIMESTAMP WITH TIME ZONE '2020-03-18 22:10:33+00', 'E com forçar o rosto, que se enfia,
');

	VALUES (504, 522, TIMESTAMP WITH TIME ZONE '2020-04-11 20:29:31+00', 'Não só contra tal fúria se sustenta,
');
	VALUES (504, 580, TIMESTAMP WITH TIME ZONE '2020-04-12 04:14:41+00', 'Em que vão descansar da longa via
');
	VALUES (504, 580, TIMESTAMP WITH TIME ZONE '2020-04-12 10:27:09+00', 'Já se viam chegados junto à terra,
');

	VALUES (505, 632, TIMESTAMP WITH TIME ZONE '2020-08-18 02:24:28+00', 'Vê que do lago donde se derrama
');
	VALUES (505, 632, TIMESTAMP WITH TIME ZONE '2020-08-18 07:52:36+00', 'Quanto de quem o canta, os numerosos
');
	VALUES (505, 523, TIMESTAMP WITH TIME ZONE '2020-08-18 15:35:09+00', 'Inventará traições e vãos venenos,
');
	VALUES (505, 632, TIMESTAMP WITH TIME ZONE '2020-08-18 19:37:07+00', 'Compunha versos doutos e venustos.
');

	VALUES (506, 523, TIMESTAMP WITH TIME ZONE '2020-08-15 21:15:36+00', '"Príncipe, que de juro senhoreias
');
	VALUES (506, 523, TIMESTAMP WITH TIME ZONE '2020-08-16 02:48:44+00', 'De um velho branco, aspecto venerando
');

	VALUES (507, 686, TIMESTAMP WITH TIME ZONE '2020-01-18 00:05:43+00', 'Mudando, os fez um pouco afeiçoados.
');
	VALUES (507, 524, TIMESTAMP WITH TIME ZONE '2020-01-18 07:31:23+00', 'A grande multidão que irá matando
');
	VALUES (507, 686, TIMESTAMP WITH TIME ZONE '2020-01-18 10:14:31+00', 'Que nesses fios de ouro reluzente
');
	VALUES (507, 524, TIMESTAMP WITH TIME ZONE '2020-01-18 12:14:32+00', 'Pera o Austro, daqui virada, a costa.
');

	VALUES (508, 624, TIMESTAMP WITH TIME ZONE '2019-04-29 09:33:00+00', 'Mil práticas alegres se tocavam;
');
	VALUES (508, 525, TIMESTAMP WITH TIME ZONE '2019-04-29 14:01:54+00', 'Abraça os companheiros como amigos,
');
	VALUES (508, 525, TIMESTAMP WITH TIME ZONE '2019-04-29 16:13:24+00', '"Viram todos o rosto aonde havia
');
	VALUES (508, 624, TIMESTAMP WITH TIME ZONE '2019-04-29 23:52:43+00', 'Quão fácil é ao corpo a sepultura!
');

	VALUES (509, 525, TIMESTAMP WITH TIME ZONE '2020-05-12 13:01:41+00', 'Que levavam roubado ousadamente.
');
	VALUES (509, 525, TIMESTAMP WITH TIME ZONE '2020-05-12 16:07:24+00', 'Condição liberal, sincero peito,
');
	VALUES (509, 525, TIMESTAMP WITH TIME ZONE '2020-05-12 18:22:22+00', 'Alguns que fosse Ofir imaginaram.
');

	VALUES (510, 526, TIMESTAMP WITH TIME ZONE '2020-02-01 05:00:43+00', 'Qualquer dos cortesãos aventureiro
');
	VALUES (510, 552, TIMESTAMP WITH TIME ZONE '2020-02-01 12:11:41+00', 'E vereis em Cochim assinalar-se
');

	VALUES (511, 624, TIMESTAMP WITH TIME ZONE '2021-02-08 02:10:24+00', 'Lhe manda rogar muito que saíssem,
');
	VALUES (511, 624, TIMESTAMP WITH TIME ZONE '2021-02-08 08:45:25+00', 'Refocilar a lassa humanidade
');
	VALUES (511, 624, TIMESTAMP WITH TIME ZONE '2021-02-08 08:55:17+00', 'As maravilhas que eu passei, passaram,
');
	VALUES (511, 624, TIMESTAMP WITH TIME ZONE '2021-02-08 14:24:08+00', 'Que quase todo o mar têm destruído
');

	VALUES (512, 527, TIMESTAMP WITH TIME ZONE '2021-01-31 06:43:47+00', 'Ouvi: vereis o nome engrandecido
');
	VALUES (512, 552, TIMESTAMP WITH TIME ZONE '2021-01-31 09:41:57+00', 'Que competia Cloris com Pomona.
');
	VALUES (512, 552, TIMESTAMP WITH TIME ZONE '2021-01-31 13:39:59+00', 'E nesta Ilha de Vénus recebidos.
');

	VALUES (513, 529, TIMESTAMP WITH TIME ZONE '2020-09-09 14:26:44+00', 'Ficaram desta súbita partida.
');

	VALUES (514, 563, TIMESTAMP WITH TIME ZONE '2020-10-14 16:04:40+00', 'Feitas do feroz Mário e do cruento
');
	VALUES (514, 563, TIMESTAMP WITH TIME ZONE '2020-10-14 18:56:47+00', 'Lhe andava já ordenando, e pretendia
');
	VALUES (514, 563, TIMESTAMP WITH TIME ZONE '2020-10-14 23:47:45+00', 'Que em vão com o Rei gentio trabalhava
');

	VALUES (515, 530, TIMESTAMP WITH TIME ZONE '2021-04-16 11:28:17+00', 'Que desejada já de tantos fora,
');
	VALUES (515, 654, TIMESTAMP WITH TIME ZONE '2021-04-16 14:38:44+00', 'Com ímpeto e braveza desmedida;
');
	VALUES (515, 530, TIMESTAMP WITH TIME ZONE '2021-04-16 21:23:51+00', 'Do Rei, para que entrassem, e consigo
');

	VALUES (516, 532, TIMESTAMP WITH TIME ZONE '2019-11-26 11:40:02+00', 'De tormentos, de mortes, pelo estilo
');
	VALUES (516, 532, TIMESTAMP WITH TIME ZONE '2019-11-26 15:41:23+00', 'Dos duros infiéis que traz consigo.
');
	VALUES (516, 611, TIMESTAMP WITH TIME ZONE '2019-11-26 17:57:09+00', 'Diz-lhe a Deusa:--"O transunto, reduzido
');

	VALUES (517, 577, TIMESTAMP WITH TIME ZONE '2019-08-13 09:54:22+00', 'Das quinas e castelos o pendão,
');
	VALUES (517, 533, TIMESTAMP WITH TIME ZONE '2019-08-13 13:14:02+00', 'E que nossos começos aspirasse.
');

	VALUES (518, 533, TIMESTAMP WITH TIME ZONE '2019-04-18 05:20:10+00', 'Tem as enchentes quais o Nilo frio;
');
	VALUES (518, 651, TIMESTAMP WITH TIME ZONE '2019-04-18 12:28:18+00', 'Mombaça é o nome da ilha e da cidade.
');
	VALUES (518, 533, TIMESTAMP WITH TIME ZONE '2019-04-18 17:11:22+00', 'Que ali tereis socorro e forte esteio."--
');

	VALUES (519, 580, TIMESTAMP WITH TIME ZONE '2018-11-09 21:52:34+00', 'Já finalmente todos assentados
');

	VALUES (520, 694, TIMESTAMP WITH TIME ZONE '2018-12-03 13:36:10+00', 'De dar a todo o Lusitano feito
');

	VALUES (521, 538, TIMESTAMP WITH TIME ZONE '2019-12-29 07:52:29+00', 'Outros pendem da verga, e já desatam
');
	VALUES (521, 538, TIMESTAMP WITH TIME ZONE '2019-12-29 15:41:00+00', 'Também nestas palavras lhe mentia,
');

	VALUES (522, 540, TIMESTAMP WITH TIME ZONE '2021-03-13 05:38:02+00', 'Se vê, e de seu propósito mudado.
');
	VALUES (522, 540, TIMESTAMP WITH TIME ZONE '2021-03-13 07:56:23+00', 'Por terem o remédio verdadeiro
');
	VALUES (522, 540, TIMESTAMP WITH TIME ZONE '2021-03-13 09:43:52+00', 'Súbitas trovoadas temerosas,
');
	VALUES (522, 540, TIMESTAMP WITH TIME ZONE '2021-03-13 10:16:43+00', 'Não vence; que a vitória verdadeira
');

	VALUES (523, 670, TIMESTAMP WITH TIME ZONE '2020-09-15 20:22:46+00', 'Passado ir repousar, e em tempo breve
');

	VALUES (524, 544, TIMESTAMP WITH TIME ZONE '2019-09-02 21:27:52+00', 'Mas louvar os meus próprios, arreceio
');

	VALUES (525, 597, TIMESTAMP WITH TIME ZONE '2020-08-09 21:05:00+00', 'Sujeita a feminino senhorio
');

	VALUES (526, 692, TIMESTAMP WITH TIME ZONE '2019-05-28 06:04:57+00', 'Na mão levava (feito nunca feito!)
');

	VALUES (527, 545, TIMESTAMP WITH TIME ZONE '2021-03-28 05:11:38+00', 'Não sendo seu soldado exprimentado,
');
	VALUES (527, 664, TIMESTAMP WITH TIME ZONE '2021-03-28 08:28:21+00', 'E como quem não era já noviço
');
	VALUES (527, 545, TIMESTAMP WITH TIME ZONE '2021-03-28 11:24:50+00', 'Põe tu, Ninfa, em efeito meu desejo,
');

	VALUES (528, 546, TIMESTAMP WITH TIME ZONE '2020-08-02 13:17:59+00', 'Cheiro suave, ardente especiaria.
');
	VALUES (528, 567, TIMESTAMP WITH TIME ZONE '2020-08-02 14:34:43+00', 'Todas as que têm título de belas,
');

	VALUES (529, 546, TIMESTAMP WITH TIME ZONE '2021-04-14 10:08:02+00', 'Todos foram de fraca carne humana.
');

	VALUES (530, 679, TIMESTAMP WITH TIME ZONE '2019-09-17 19:44:40+00', 'Braço forte, de gente sublimada,
');

	VALUES (531, 669, TIMESTAMP WITH TIME ZONE '2019-11-03 17:22:48+00', 'Porque esta era a cidade das melhores
');
	VALUES (531, 669, TIMESTAMP WITH TIME ZONE '2019-11-03 21:02:17+00', 'E néctar sobre todos esparziu.
');
	VALUES (531, 669, TIMESTAMP WITH TIME ZONE '2019-11-04 01:19:37+00', 'Nos pudessem mandar ao reino escuro,
');

	VALUES (532, 559, TIMESTAMP WITH TIME ZONE '2020-01-25 04:21:18+00', 'Do belo corpo estavam confiadas,
');
	VALUES (532, 548, TIMESTAMP WITH TIME ZONE '2020-01-25 11:12:23+00', 'Vós, ó côncavos vales, que pudestes
');
	VALUES (532, 548, TIMESTAMP WITH TIME ZONE '2020-01-25 15:58:48+00', 'Ao vento leve, e à seta bem talhada,
');
	VALUES (532, 548, TIMESTAMP WITH TIME ZONE '2020-01-25 21:35:52+00', 'Senão direi que tens algum receio,
');

	VALUES (533, 549, TIMESTAMP WITH TIME ZONE '2020-10-25 00:52:12+00', 'Do metal, que Fortuna a tantos nega,
');

	VALUES (534, 580, TIMESTAMP WITH TIME ZONE '2021-03-08 14:20:21+00', 'Altura nace, junto à qual, também
');
	VALUES (534, 580, TIMESTAMP WITH TIME ZONE '2021-03-08 19:36:47+00', 'Ele constante, e de ira nobre aceso,
');

	VALUES (535, 609, TIMESTAMP WITH TIME ZONE '2021-03-06 16:15:30+00', 'Quando o Bétis de sangue se tingia,
');
	VALUES (535, 609, TIMESTAMP WITH TIME ZONE '2021-03-06 20:08:13+00', 'Que vencedor o torna de vencido:
');
	VALUES (535, 609, TIMESTAMP WITH TIME ZONE '2021-03-07 02:23:56+00', 'Que de nenhum passado se contenta;
');
	VALUES (535, 609, TIMESTAMP WITH TIME ZONE '2021-03-07 07:50:32+00', 'As palavras dum vago navegante.
');

	VALUES (536, 567, TIMESTAMP WITH TIME ZONE '2020-01-03 00:06:04+00', 'Nos ares se alevantam nobremente,
');
	VALUES (536, 552, TIMESTAMP WITH TIME ZONE '2020-01-03 04:09:31+00', '"Não quis ficar nos Reinos ocioso
');
	VALUES (536, 552, TIMESTAMP WITH TIME ZONE '2020-01-03 08:57:46+00', 'E mais também mandado tinha a terra,
');

	VALUES (537, 590, TIMESTAMP WITH TIME ZONE '2020-05-07 21:16:25+00', 'Este famoso Rei, todos os dias,
');
	VALUES (537, 552, TIMESTAMP WITH TIME ZONE '2020-05-07 22:53:45+00', 'Para onde Alcides pôs a extrema meta.
');

	VALUES (538, 647, TIMESTAMP WITH TIME ZONE '2020-04-21 07:40:00+00', 'Que com cem olhos vê, e por onde voa,
');

	VALUES (539, 627, TIMESTAMP WITH TIME ZONE '2020-11-09 09:55:18+00', 'Desbaratareis tudo o que quiserdes,
');
	VALUES (539, 555, TIMESTAMP WITH TIME ZONE '2020-11-09 16:30:59+00', 'De suas esperanças não delira.
');
	VALUES (539, 627, TIMESTAMP WITH TIME ZONE '2020-11-09 21:10:26+00', '(Que ela só sabe o bem de que se serve)
');
	VALUES (539, 555, TIMESTAMP WITH TIME ZONE '2020-11-10 02:10:22+00', 'Entranhas ardentíssimos suspiros;
');

	VALUES (540, 686, TIMESTAMP WITH TIME ZONE '2021-01-14 16:28:09+00', 'Dos perigos a que ele se oferece;
');
	VALUES (540, 556, TIMESTAMP WITH TIME ZONE '2021-01-14 20:08:42+00', 'Dos odres e Calipsos namoradas;
');
	VALUES (540, 686, TIMESTAMP WITH TIME ZONE '2021-01-15 01:08:26+00', 'Torna para detrás a nau forçada,
');

	VALUES (541, 556, TIMESTAMP WITH TIME ZONE '2021-02-16 18:22:18+00', 'Que quer fechar o mar Mediterrano,
');
	VALUES (541, 556, TIMESTAMP WITH TIME ZONE '2021-02-16 21:51:46+00', 'Que Gueos se chamam, de selvages vidas;
');

	VALUES (542, 557, TIMESTAMP WITH TIME ZONE '2020-04-25 17:19:29+00', 'E como ia afrontada do caminho,
');
	VALUES (542, 633, TIMESTAMP WITH TIME ZONE '2020-04-25 17:41:08+00', 'Afeiçoada à gente Lusitana,
');
	VALUES (542, 633, TIMESTAMP WITH TIME ZONE '2020-04-26 01:14:06+00', 'Tem todo seu poder, fero Cupido,
');
	VALUES (542, 557, TIMESTAMP WITH TIME ZONE '2020-04-26 04:33:38+00', 'Ora, sus, gente forte, que na guerra
');

	VALUES (543, 588, TIMESTAMP WITH TIME ZONE '2021-02-15 06:34:15+00', 'Ficava o caro Tejo, e a fresca serra
');

	VALUES (544, 582, TIMESTAMP WITH TIME ZONE '2020-03-18 07:22:07+00', 'Ferina e a ira não lhe compadecem
');

	VALUES (545, 559, TIMESTAMP WITH TIME ZONE '2020-01-14 01:36:50+00', 'Do outro Pedro cruíssimo os alcança,
');
	VALUES (545, 559, TIMESTAMP WITH TIME ZONE '2020-01-14 02:01:43+00', 'Razões aprende, e cuida que é prudente,
');
	VALUES (545, 559, TIMESTAMP WITH TIME ZONE '2020-01-14 07:34:24+00', 'Do Duque são com festa agasalhados,
');

	VALUES (546, 676, TIMESTAMP WITH TIME ZONE '2020-02-10 04:24:53+00', 'Que em si está sempre as almas transformando,
');
	VALUES (546, 676, TIMESTAMP WITH TIME ZONE '2020-02-10 04:42:38+00', 'Soam os atambores o pandeiros,
');
	VALUES (546, 676, TIMESTAMP WITH TIME ZONE '2020-02-10 05:50:20+00', 'Que as imortalidades que fingia
');

	VALUES (547, 561, TIMESTAMP WITH TIME ZONE '2021-04-10 18:04:34+00', 'Com seu veneno os morde enveja tanta,
');
	VALUES (547, 561, TIMESTAMP WITH TIME ZONE '2021-04-10 19:46:06+00', 'Que lágrimas são a água, e o nome amores.
');
	VALUES (547, 562, TIMESTAMP WITH TIME ZONE '2021-04-10 21:02:39+00', 'Tomou de espaço, por subtil partido.
');

	VALUES (548, 562, TIMESTAMP WITH TIME ZONE '2021-05-07 08:26:03+00', 'Seguem guerreiras damas seus amigos,
');
	VALUES (548, 603, TIMESTAMP WITH TIME ZONE '2021-05-07 14:30:00+00', 'De quem foge o ensífero Orionte,
');
	VALUES (548, 562, TIMESTAMP WITH TIME ZONE '2021-05-07 15:09:33+00', 'Que pode não temer a lei Leteia.
');
	VALUES (548, 562, TIMESTAMP WITH TIME ZONE '2021-05-07 18:16:18+00', 'Monçaide entre eles vai interpretando
');

	VALUES (549, 672, TIMESTAMP WITH TIME ZONE '2021-05-12 07:58:10+00', 'Todas de tal nobreza e tal valor,
');
	VALUES (549, 562, TIMESTAMP WITH TIME ZONE '2021-05-12 10:32:21+00', 'De quem me descobriu, suma vingança.
');

	VALUES (550, 563, TIMESTAMP WITH TIME ZONE '2020-05-08 05:46:08+00', 'A vós, na costa de África arenosa,
');
	VALUES (550, 563, TIMESTAMP WITH TIME ZONE '2020-05-08 09:05:57+00', 'Te roga que, de nada receoso,
');

	VALUES (551, 564, TIMESTAMP WITH TIME ZONE '2021-01-20 15:08:10+00', 'Responde Leonardo, que trazia
');
	VALUES (551, 564, TIMESTAMP WITH TIME ZONE '2021-01-20 16:54:56+00', 'De quem virtude deve ser prezada.
');
	VALUES (551, 564, TIMESTAMP WITH TIME ZONE '2021-01-20 23:57:42+00', 'Quantos estão os Trópicos queimando.
');
	VALUES (551, 564, TIMESTAMP WITH TIME ZONE '2021-01-21 03:29:37+00', 'Co''o vento, o seco mato vai queimando;
');

	VALUES (552, 564, TIMESTAMP WITH TIME ZONE '2021-01-14 06:14:54+00', 'Cor, com que tu, rubi, teu preço perdes;
');
	VALUES (552, 564, TIMESTAMP WITH TIME ZONE '2021-01-14 07:21:00+00', 'Torres altas se vêem no campo aberto
');
	VALUES (552, 656, TIMESTAMP WITH TIME ZONE '2021-01-14 10:23:51+00', 'E mil vezes tiranos torna os Reis.
');

	VALUES (553, 612, TIMESTAMP WITH TIME ZONE '2019-05-26 15:28:37+00', 'As vezes leis magnânimas quebranta.
');
	VALUES (553, 565, TIMESTAMP WITH TIME ZONE '2019-05-26 20:31:10+00', '"Sancho, forte mancebo, que ficara
');
	VALUES (553, 612, TIMESTAMP WITH TIME ZONE '2019-05-26 21:33:45+00', 'Uns leva a defensão da própria terra,
');
	VALUES (553, 612, TIMESTAMP WITH TIME ZONE '2019-05-27 03:16:04+00', 'Destruídos depois da Grega insânia.
');

	VALUES (554, 566, TIMESTAMP WITH TIME ZONE '2020-12-11 00:04:07+00', 'Com Ásia se avizinha; mas o rio
');
	VALUES (554, 602, TIMESTAMP WITH TIME ZONE '2020-12-11 01:42:16+00', 'Se acumulam os pratos de fulvo ouro,
');

	VALUES (555, 586, TIMESTAMP WITH TIME ZONE '2020-12-05 07:22:51+00', 'Fazem que não lha comprem mercadores;
');

	VALUES (556, 567, TIMESTAMP WITH TIME ZONE '2018-03-18 10:13:06+00', 'Que assentou pera o Austro a Natureza.
');
	VALUES (556, 567, TIMESTAMP WITH TIME ZONE '2018-03-18 17:14:30+00', 'Que agora tem do mundo o senhorio,
');
	VALUES (556, 631, TIMESTAMP WITH TIME ZONE '2018-03-18 17:31:13+00', 'Ó caso nunca visto e milagroso,
');

	VALUES (557, 667, TIMESTAMP WITH TIME ZONE '2021-01-12 22:25:16+00', 'Das Tágides gentis, e seu respeito.
');
	VALUES (557, 667, TIMESTAMP WITH TIME ZONE '2021-01-12 23:53:11+00', 'Mareiam velas; ferve a gente irada,
');
	VALUES (557, 568, TIMESTAMP WITH TIME ZONE '2021-01-13 07:14:42+00', 'Já não defenderá somente os passos,
');

	VALUES (558, 597, TIMESTAMP WITH TIME ZONE '2020-07-10 09:32:39+00', 'Uns pequenos batéis, que vêm daquela
');
	VALUES (558, 570, TIMESTAMP WITH TIME ZONE '2020-07-10 16:16:18+00', 'Contra sua natureza se meterem.
');
	VALUES (558, 570, TIMESTAMP WITH TIME ZONE '2020-07-10 19:25:21+00', 'Com as nuvens de fumo o Sol tomando;
');

	VALUES (559, 579, TIMESTAMP WITH TIME ZONE '2020-11-06 10:45:12+00', 'Atai as mãos a vosso vão receio,
');

	VALUES (560, 573, TIMESTAMP WITH TIME ZONE '2020-11-11 09:43:02+00', 'Foi refazer-se o inimigo magoado;
');
	VALUES (560, 573, TIMESTAMP WITH TIME ZONE '2020-11-11 12:32:36+00', 'Das cores a formosa diferença
');
	VALUES (560, 573, TIMESTAMP WITH TIME ZONE '2020-11-11 15:15:36+00', 'Somente no venéreo ajuntamento
');

	VALUES (561, 657, TIMESTAMP WITH TIME ZONE '2021-01-05 00:26:46+00', 'Entro um e outro rio, em grande espaço,
');
	VALUES (561, 657, TIMESTAMP WITH TIME ZONE '2021-01-05 07:30:11+00', 'Se esta gente, que busca outro hemisfério,
');
	VALUES (561, 575, TIMESTAMP WITH TIME ZONE '2021-01-05 15:21:16+00', 'Cores de quem a vista julga e sente
');

	VALUES (562, 575, TIMESTAMP WITH TIME ZONE '2019-11-24 02:24:04+00', 'Se o Capitão mais tempo detivesse.
');
	VALUES (562, 667, TIMESTAMP WITH TIME ZONE '2019-11-24 05:52:56+00', 'Foi a batalha tão sanguina e fera,
');
	VALUES (562, 575, TIMESTAMP WITH TIME ZONE '2019-11-24 11:59:02+00', 'Em nome de Jesu crucificado:
');

	VALUES (563, 691, TIMESTAMP WITH TIME ZONE '2019-07-06 17:59:14+00', 'Erguidos com soberba graciosa,
');

	VALUES (564, 578, TIMESTAMP WITH TIME ZONE '2019-08-07 18:45:11+00', 'Do culto antigo os ídolos adora,
');
	VALUES (564, 662, TIMESTAMP WITH TIME ZONE '2019-08-08 02:13:46+00', 'Entre a costa Etiópica e a famosa
');
	VALUES (564, 578, TIMESTAMP WITH TIME ZONE '2019-08-08 08:46:39+00', 'Se alcançam com trabalho e com fadiga;
');
	VALUES (564, 662, TIMESTAMP WITH TIME ZONE '2019-08-08 13:05:59+00', 'Por vós, ó Rei, o espírito e a carne é pronta."
');

	VALUES (565, 579, TIMESTAMP WITH TIME ZONE '2019-09-04 18:28:48+00', 'De nada a forte gente se temia.
');
	VALUES (565, 579, TIMESTAMP WITH TIME ZONE '2019-09-04 19:42:44+00', 'A Deus pedi que removesse os duros
');

	VALUES (566, 581, TIMESTAMP WITH TIME ZONE '2020-01-07 02:18:08+00', 'Das perlas de Barém tributo rico.
');
	VALUES (566, 581, TIMESTAMP WITH TIME ZONE '2020-01-07 06:58:53+00', 'Por calmas, por tormentas e opressões,
');
	VALUES (566, 581, TIMESTAMP WITH TIME ZONE '2020-01-07 09:21:45+00', 'Estará de contino aparelhado
');
	VALUES (566, 649, TIMESTAMP WITH TIME ZONE '2020-01-07 15:59:55+00', 'Um padrão nesta terra alevantamos,
');

	VALUES (567, 584, TIMESTAMP WITH TIME ZONE '2020-12-03 00:28:19+00', 'Ali no bico traz ao caro ninho
');
	VALUES (567, 584, TIMESTAMP WITH TIME ZONE '2020-12-03 02:07:10+00', 'Vê-lo entre os duvidosos tão inteiro
');
	VALUES (567, 584, TIMESTAMP WITH TIME ZONE '2020-12-03 06:58:11+00', 'Tantas vezes a morte apercebida!
');
	VALUES (567, 584, TIMESTAMP WITH TIME ZONE '2020-12-03 12:02:54+00', 'Lá teve de Torcato e de Corvino.
');

	VALUES (568, 585, TIMESTAMP WITH TIME ZONE '2020-04-16 06:39:53+00', 'Por ver o navegante destruído,
');
	VALUES (568, 585, TIMESTAMP WITH TIME ZONE '2020-04-16 09:50:46+00', 'E todos outra vez desbaratando,
');
	VALUES (568, 585, TIMESTAMP WITH TIME ZONE '2020-04-16 13:20:30+00', '"Que, se aqui a razão se não mostrasse
');

	VALUES (569, 661, TIMESTAMP WITH TIME ZONE '2019-06-14 07:11:25+00', 'Que qualquer longo tempo curto seja:
');
	VALUES (569, 661, TIMESTAMP WITH TIME ZONE '2019-06-14 08:03:07+00', 'Mas já nas naus os bons trabalhadores
');
	VALUES (569, 585, TIMESTAMP WITH TIME ZONE '2019-06-14 13:49:30+00', 'Desta maneira as outras amansavam
');

	VALUES (570, 587, TIMESTAMP WITH TIME ZONE '2020-11-25 12:09:16+00', 'Por lhe pôr em sossego o peito irado,
');
	VALUES (570, 613, TIMESTAMP WITH TIME ZONE '2020-11-25 14:03:08+00', 'Ouviu-lhe essas palavras piedosas
');

	VALUES (571, 587, TIMESTAMP WITH TIME ZONE '2020-12-11 23:47:35+00', 'Fonte de desamparos e adultérios,
');
	VALUES (571, 587, TIMESTAMP WITH TIME ZONE '2020-12-12 03:19:30+00', 'Que a faz imaginar no peito alheio.
');

	VALUES (572, 692, TIMESTAMP WITH TIME ZONE '2021-04-04 23:35:38+00', 'Que não somente, ousados, se contentam
');
	VALUES (572, 588, TIMESTAMP WITH TIME ZONE '2021-04-05 00:54:03+00', 'Diverso povo, rico e prosperado
');
	VALUES (572, 588, TIMESTAMP WITH TIME ZONE '2021-04-05 01:05:17+00', 'Entrando o mensageiro pelo rio,
');
	VALUES (572, 588, TIMESTAMP WITH TIME ZONE '2021-04-05 03:56:01+00', 'Com que a seu jugo e lei someteria
');

	VALUES (573, 626, TIMESTAMP WITH TIME ZONE '2021-03-30 03:12:05+00', 'Que o vil ócio no mundo traz consigo,
');
	VALUES (573, 626, TIMESTAMP WITH TIME ZONE '2021-03-30 06:13:25+00', 'De Assírios, Persas, Gregos e Romanos.
');

	VALUES (574, 590, TIMESTAMP WITH TIME ZONE '2020-04-21 15:29:49+00', 'Mas dos onze a ilustríssima companha
');

	VALUES (575, 590, TIMESTAMP WITH TIME ZONE '2020-04-26 15:30:48+00', 'Mas no lago entraremos de Aqueronte.
');
	VALUES (575, 663, TIMESTAMP WITH TIME ZONE '2020-04-26 23:01:19+00', 'Da terra imensa, e mar não navegado,
');
	VALUES (575, 663, TIMESTAMP WITH TIME ZONE '2020-04-27 03:09:05+00', 'Olha essa terra toda, que se habita
');

	VALUES (576, 619, TIMESTAMP WITH TIME ZONE '2020-08-17 17:07:29+00', 'Nos contrários fazendo imenso dano,
');
	VALUES (576, 591, TIMESTAMP WITH TIME ZONE '2020-08-17 19:39:44+00', 'E a vazante, que foge apressurada.
');

	VALUES (577, 591, TIMESTAMP WITH TIME ZONE '2019-09-22 00:03:34+00', 'Vence os imigos d''alma todos sete;
');

	VALUES (578, 621, TIMESTAMP WITH TIME ZONE '2019-03-23 07:52:14+00', 'Vários de gestos, vários de pinturas,
');
	VALUES (578, 621, TIMESTAMP WITH TIME ZONE '2019-03-23 15:29:27+00', 'Por obra deste, o Sol, andando a tento,
');
	VALUES (578, 621, TIMESTAMP WITH TIME ZONE '2019-03-23 22:20:34+00', 'Isto feito, se parte diligente
');
	VALUES (578, 592, TIMESTAMP WITH TIME ZONE '2019-03-23 23:16:40+00', 'Serão dadas na terra leis melhores.
');

	VALUES (579, 670, TIMESTAMP WITH TIME ZONE '2020-10-05 17:34:58+00', 'Estão não só do Itálico Falerno
');
	VALUES (579, 670, TIMESTAMP WITH TIME ZONE '2020-10-05 19:29:25+00', 'Alguns negros, se parte as velas dando.
');
	VALUES (579, 670, TIMESTAMP WITH TIME ZONE '2020-10-05 20:20:24+00', 'Nô mais, Musa, nô mais, que a Lira tenho
');

	VALUES (580, 593, TIMESTAMP WITH TIME ZONE '2021-04-09 12:14:01+00', 'Pelo tomar; mas, antes que chegasse,
');
	VALUES (580, 681, TIMESTAMP WITH TIME ZONE '2021-04-09 15:57:07+00', 'A quem não chega a Egípcia antiga fama,
');
	VALUES (580, 593, TIMESTAMP WITH TIME ZONE '2021-04-09 23:20:09+00', 'Por fogo, ferro, água, calma e frio,
');
	VALUES (580, 593, TIMESTAMP WITH TIME ZONE '2021-04-10 06:05:20+00', 'Se to tem dito já aquela ventura,
');

	VALUES (581, 647, TIMESTAMP WITH TIME ZONE '2020-04-20 04:16:45+00', 'O velho Afonso, Príncipe subido,
');

	VALUES (582, 596, TIMESTAMP WITH TIME ZONE '2018-05-24 14:22:34+00', 'Razões diversas dando e recebendo.
');

	VALUES (583, 667, TIMESTAMP WITH TIME ZONE '2020-07-08 11:21:00+00', 'Com os olhos, que de tudo são senhores,
');
	VALUES (583, 667, TIMESTAMP WITH TIME ZONE '2020-07-08 11:30:35+00', 'Que das nações na costa moradoras
');
	VALUES (583, 595, TIMESTAMP WITH TIME ZONE '2020-07-08 12:11:09+00', 'Mandados da Rainha, que abundantes
');

	VALUES (584, 624, TIMESTAMP WITH TIME ZONE '2020-06-26 20:53:25+00', '"Assim como a bonina, que cortada
');
	VALUES (584, 624, TIMESTAMP WITH TIME ZONE '2020-06-26 22:24:31+00', 'Outro louvor do Deus de Tomé canta.
');
	VALUES (584, 595, TIMESTAMP WITH TIME ZONE '2020-06-27 01:49:26+00', 'Que nunca veja as partes do Oriente.
');

	VALUES (585, 597, TIMESTAMP WITH TIME ZONE '2020-07-15 03:16:26+00', 'Em vários pensamentos se derrama;
');
	VALUES (585, 597, TIMESTAMP WITH TIME ZONE '2020-07-15 10:44:20+00', 'Esquadrão de Gentios e de Mouros.
');
	VALUES (585, 597, TIMESTAMP WITH TIME ZONE '2020-07-15 11:05:26+00', 'Deixou antes vencer da morte a vida;
');
	VALUES (585, 683, TIMESTAMP WITH TIME ZONE '2020-07-15 11:32:36+00', 'E quem vos fez molesto tratamento,
');

	VALUES (586, 681, TIMESTAMP WITH TIME ZONE '2020-11-23 04:39:30+00', 'Lhe diz, os grandes feitos que fizeram,
');
	VALUES (586, 597, TIMESTAMP WITH TIME ZONE '2020-11-23 07:33:13+00', 'Por estender coa fama a curta vida.
');

	VALUES (587, 599, TIMESTAMP WITH TIME ZONE '2021-01-15 04:34:57+00', 'Eis, de meus companheiros rodeado,
');
	VALUES (587, 599, TIMESTAMP WITH TIME ZONE '2021-01-15 10:42:15+00', 'Quando, depois de um pouco estar cuidando,
');
	VALUES (587, 629, TIMESTAMP WITH TIME ZONE '2021-01-15 18:12:12+00', 'Isto dizendo, desce ao mar aberto,
');
	VALUES (587, 629, TIMESTAMP WITH TIME ZONE '2021-01-15 21:30:41+00', 'Viemos pôr a última coluna.
');

	VALUES (588, 599, TIMESTAMP WITH TIME ZONE '2020-12-31 02:49:07+00', 'Que, vindo o Castelhano devastando
');
	VALUES (588, 645, TIMESTAMP WITH TIME ZONE '2020-12-31 08:59:10+00', 'Da gente, que a ver só concorre leda;
');
	VALUES (588, 599, TIMESTAMP WITH TIME ZONE '2020-12-31 09:56:05+00', 'Avante passa, e faz correr vermelho
');
	VALUES (588, 599, TIMESTAMP WITH TIME ZONE '2020-12-31 10:48:30+00', 'Bem parece que o nobre e grã conceito
');

	VALUES (589, 619, TIMESTAMP WITH TIME ZONE '2020-07-31 09:12:03+00', 'Tem todo seu poder, fero Cupido,
');
	VALUES (589, 600, TIMESTAMP WITH TIME ZONE '2020-07-31 15:48:21+00', 'Em sinal destes cinco Reis vencidos,
');
	VALUES (589, 600, TIMESTAMP WITH TIME ZONE '2020-07-31 23:09:55+00', 'Desprezador das honras e dinheiro,
');

	VALUES (590, 673, TIMESTAMP WITH TIME ZONE '2020-01-12 06:02:25+00', 'Vendo a formosa dama desejada,
');

	VALUES (591, 601, TIMESTAMP WITH TIME ZONE '2020-11-20 19:22:32+00', '(Alcançada já a paz áurea divina)
');
	VALUES (591, 645, TIMESTAMP WITH TIME ZONE '2020-11-21 01:04:43+00', '"Tal do Rei novo o estâmago acendido
');
	VALUES (591, 645, TIMESTAMP WITH TIME ZONE '2020-11-21 06:27:52+00', '"Com força, não; com manha vergonhosa,
');

	VALUES (592, 601, TIMESTAMP WITH TIME ZONE '2020-12-13 23:02:32+00', 'Depois de ter com os Mouros superado,
');
	VALUES (592, 612, TIMESTAMP WITH TIME ZONE '2020-12-14 04:14:14+00', 'O Perimal: de sábios e eloquentes,
');
	VALUES (592, 601, TIMESTAMP WITH TIME ZONE '2020-12-14 10:52:37+00', 'O Gama e Portugueses no aposento
');
	VALUES (592, 601, TIMESTAMP WITH TIME ZONE '2020-12-14 14:26:29+00', 'Dizer ao Rei (segundo o que entendia)
');

	VALUES (593, 664, TIMESTAMP WITH TIME ZONE '2021-04-12 05:14:00+00', '"Se por ventura vinham de Turquia?"
');
	VALUES (593, 602, TIMESTAMP WITH TIME ZONE '2021-04-12 06:03:36+00', 'Cujo pomo contra o veneno urgente
');
	VALUES (593, 664, TIMESTAMP WITH TIME ZONE '2021-04-12 10:14:52+00', '"Quantos rostos ali se vêem sem cor,
');
	VALUES (593, 664, TIMESTAMP WITH TIME ZONE '2021-04-12 13:52:17+00', '"E posto enfim que desde o mar de Atlante
');

	VALUES (594, 608, TIMESTAMP WITH TIME ZONE '2020-06-28 06:20:59+00', 'De cego na alegria bruta, insana,
');
	VALUES (594, 608, TIMESTAMP WITH TIME ZONE '2020-06-28 11:17:50+00', 'Posto que em todo o mundo, de afrontados,
');
	VALUES (594, 608, TIMESTAMP WITH TIME ZONE '2020-06-28 19:06:46+00', 'Com a gente, e com as novas muito mais:
');

	VALUES (595, 619, TIMESTAMP WITH TIME ZONE '2020-09-18 06:56:41+00', 'Co''o peito desprezou firme e sereno,
');

	VALUES (596, 623, TIMESTAMP WITH TIME ZONE '2020-07-16 15:29:47+00', 'Vão rinchando os cavalos jaezados.
');
	VALUES (596, 605, TIMESTAMP WITH TIME ZONE '2020-07-16 22:56:00+00', 'Que os soluços e lágrimas aumenta,
');

	VALUES (597, 689, TIMESTAMP WITH TIME ZONE '2020-06-12 16:29:52+00', 'Começam novas forças a ir tomando,
');
	VALUES (597, 689, TIMESTAMP WITH TIME ZONE '2020-06-12 20:12:02+00', 'O Mouro, nos tais casos sábio e velho,
');
	VALUES (597, 606, TIMESTAMP WITH TIME ZONE '2020-06-13 02:24:59+00', 'Gotas, que o corpo vão banhando;
');
	VALUES (597, 606, TIMESTAMP WITH TIME ZONE '2020-06-13 07:31:50+00', 'Amam somente mandos e riqueza,
');

	VALUES (598, 608, TIMESTAMP WITH TIME ZONE '2019-02-16 06:21:25+00', 'De ainda poder seu fado ter mudança,
');
	VALUES (598, 642, TIMESTAMP WITH TIME ZONE '2019-02-16 06:43:41+00', 'A desesperarão, e frio medo
');

	VALUES (599, 678, TIMESTAMP WITH TIME ZONE '2019-01-24 23:12:45+00', 'Dois invernos fazendo e dois verões,
');
	VALUES (599, 678, TIMESTAMP WITH TIME ZONE '2019-01-25 06:21:02+00', 'Comércio consentir das abastanças
');
	VALUES (599, 608, TIMESTAMP WITH TIME ZONE '2019-01-25 13:50:30+00', 'Até que venha o tempo de mostrar-se;
');
	VALUES (599, 608, TIMESTAMP WITH TIME ZONE '2019-01-25 15:48:42+00', 'Do cheiroso licor que o tronco chora,
');

	VALUES (600, 619, TIMESTAMP WITH TIME ZONE '2020-09-08 13:20:38+00', 'Verás as várias partes, que os insanos
');
	VALUES (600, 610, TIMESTAMP WITH TIME ZONE '2020-09-08 16:35:03+00', '"Basiliscos medonhos e liões,
');

	VALUES (601, 650, TIMESTAMP WITH TIME ZONE '2020-11-27 20:09:48+00', 'Se satisfez do mantimento nobre,
');

	VALUES (602, 623, TIMESTAMP WITH TIME ZONE '2020-11-09 12:56:18+00', 'Pouca tardança faz Lieu irado
');
	VALUES (602, 623, TIMESTAMP WITH TIME ZONE '2020-11-09 17:17:57+00', 'Se em vossos próprios filhos vos vingais
');
	VALUES (602, 614, TIMESTAMP WITH TIME ZONE '2020-11-09 22:07:26+00', 'Ministros amostrar as armaduras:
');

	VALUES (603, 667, TIMESTAMP WITH TIME ZONE '2020-12-22 17:27:43+00', 'Aonde para sempre se acabasse.
');
	VALUES (603, 614, TIMESTAMP WITH TIME ZONE '2020-12-22 18:26:40+00', 'Água das fontes, doce e cristalina;
');
	VALUES (603, 667, TIMESTAMP WITH TIME ZONE '2020-12-22 20:48:42+00', 'Que, por salvar o povo miserando
');
	VALUES (603, 667, TIMESTAMP WITH TIME ZONE '2020-12-23 02:32:22+00', 'Já da real presença veneranda
');

	VALUES (604, 647, TIMESTAMP WITH TIME ZONE '2020-04-04 03:34:52+00', 'E não a mim, que creio o que podeis!"
');

	VALUES (605, 682, TIMESTAMP WITH TIME ZONE '2020-08-28 21:20:33+00', 'Que dar a tais barões seu reino e estado;
');

	VALUES (606, 619, TIMESTAMP WITH TIME ZONE '2020-09-27 10:51:57+00', 'Se vê, e de seu propósito mudado.
');
	VALUES (606, 690, TIMESTAMP WITH TIME ZONE '2020-09-27 18:43:16+00', 'Para onde estava o Padre, se moveu.
');

	VALUES (607, 655, TIMESTAMP WITH TIME ZONE '2020-02-17 04:56:36+00', '"Esta lhe dá com o título excelente
');
	VALUES (607, 620, TIMESTAMP WITH TIME ZONE '2020-02-17 09:41:20+00', 'Um ao outro, a maneira de peleja.
');
	VALUES (607, 620, TIMESTAMP WITH TIME ZONE '2020-02-17 14:10:10+00', 'Claríssimo por ele penetrava,
');

	VALUES (608, 621, TIMESTAMP WITH TIME ZONE '2018-10-12 03:59:06+00', 'Como dama que foi do incauto amante
');
	VALUES (608, 691, TIMESTAMP WITH TIME ZONE '2018-10-12 11:12:43+00', 'Qual Iopas não soube, ou Demodoco,
');
	VALUES (608, 691, TIMESTAMP WITH TIME ZONE '2018-10-12 16:10:42+00', 'Que se amansava o mar de maravilha.
');
	VALUES (608, 621, TIMESTAMP WITH TIME ZONE '2018-10-13 00:05:59+00', 'Por que de mim te vás, ó filho caro,
');

	VALUES (609, 673, TIMESTAMP WITH TIME ZONE '2019-08-26 15:11:37+00', 'A nau grande, em que vai Paulo da Gama,
');
	VALUES (609, 621, TIMESTAMP WITH TIME ZONE '2019-08-26 22:06:40+00', '"O qual, como do nobre pensamento
');
	VALUES (609, 673, TIMESTAMP WITH TIME ZONE '2019-08-27 02:48:12+00', 'Os dons que dá Pomona, ali Natura
');
	VALUES (609, 621, TIMESTAMP WITH TIME ZONE '2019-08-27 08:52:49+00', 'Perigo algum nos vossos Lusitanos,
');

	VALUES (610, 658, TIMESTAMP WITH TIME ZONE '2021-01-25 06:38:19+00', 'Os trabalhos tão longos compensando.
');
	VALUES (610, 622, TIMESTAMP WITH TIME ZONE '2021-01-25 08:57:34+00', 'Exércitos conformes à peleja,
');

	VALUES (611, 636, TIMESTAMP WITH TIME ZONE '2021-01-28 14:04:09+00', 'Padecerá, pola Fé santa sua.
');
	VALUES (611, 622, TIMESTAMP WITH TIME ZONE '2021-01-28 16:04:22+00', 'Por vos servir, a tudo aparelhados;
');

	VALUES (612, 689, TIMESTAMP WITH TIME ZONE '2020-05-21 10:50:09+00', 'Até que na cerviz seu jugo meta
');
	VALUES (612, 689, TIMESTAMP WITH TIME ZONE '2020-05-21 14:19:04+00', '"Também farão Mombaça, que se arreia
');

	VALUES (613, 658, TIMESTAMP WITH TIME ZONE '2019-05-20 10:51:43+00', 'Ou na virtude de teu gesto lindo
');

	VALUES (614, 676, TIMESTAMP WITH TIME ZONE '2020-01-16 11:01:15+00', 'Foi nas forças Caudinas, de ignorante,
');

	VALUES (615, 675, TIMESTAMP WITH TIME ZONE '2020-02-10 18:30:22+00', 'Do Rei, que já sabia a gente que era:
');

	VALUES (616, 646, TIMESTAMP WITH TIME ZONE '2020-04-06 07:37:09+00', 'Que tanto tempo há já que vai buscando.
');

	VALUES (617, 661, TIMESTAMP WITH TIME ZONE '2020-11-18 19:42:11+00', 'Virá despois com ceptro a governá-Ia
');
	VALUES (617, 661, TIMESTAMP WITH TIME ZONE '2020-11-19 02:23:30+00', 'A pálida doença lhe tocava
');
	VALUES (617, 627, TIMESTAMP WITH TIME ZONE '2020-11-19 04:08:59+00', 'Me tornes do que escrevo, e em vão pretendo,
');
	VALUES (617, 627, TIMESTAMP WITH TIME ZONE '2020-11-19 06:46:40+00', 'Não se aprende, Senhor, na fantasia,
');

	VALUES (618, 671, TIMESTAMP WITH TIME ZONE '2020-03-28 23:46:07+00', '"Chega-se o prazo e dia assinalado
');
	VALUES (618, 629, TIMESTAMP WITH TIME ZONE '2020-03-29 00:28:00+00', 'Germanos são os mártires de Cristo.
');
	VALUES (618, 671, TIMESTAMP WITH TIME ZONE '2020-03-29 00:51:13+00', 'Pois pelos doze Pares dar-vos quero
');

	VALUES (619, 652, TIMESTAMP WITH TIME ZONE '2020-11-20 08:52:39+00', 'De achar novas algumas, como achamos.
');
	VALUES (619, 652, TIMESTAMP WITH TIME ZONE '2020-11-20 12:00:33+00', 'Como coa mãe de Nino já mostraram,
');
	VALUES (619, 652, TIMESTAMP WITH TIME ZONE '2020-11-20 12:10:55+00', 'Ganges vem ao salgado senhorio;
');
	VALUES (619, 652, TIMESTAMP WITH TIME ZONE '2020-11-20 14:32:55+00', 'Numa mostra tão clara e tão perfeita.
');

	VALUES (620, 631, TIMESTAMP WITH TIME ZONE '2020-12-22 12:30:15+00', 'Mas, já chegado aos fins Orientais
');
	VALUES (620, 657, TIMESTAMP WITH TIME ZONE '2020-12-22 16:28:28+00', 'Digno feito de ser no mundo eterno,
');
	VALUES (620, 631, TIMESTAMP WITH TIME ZONE '2020-12-22 18:22:39+00', 'Mas Marte, que da Deusa sustentava
');

	VALUES (621, 685, TIMESTAMP WITH TIME ZONE '2020-07-18 10:19:15+00', 'Cegos, que dos trabalhos que tiveram,
');
	VALUES (621, 632, TIMESTAMP WITH TIME ZONE '2020-07-18 15:43:41+00', 'Os ventos eram tais, que não puderam
');
	VALUES (621, 632, TIMESTAMP WITH TIME ZONE '2020-07-18 16:06:12+00', '"Assim como a bonina, que cortada
');
	VALUES (621, 632, TIMESTAMP WITH TIME ZONE '2020-07-18 17:58:15+00', 'Umas, fingindo menos estimar
');

	VALUES (622, 635, TIMESTAMP WITH TIME ZONE '2020-09-04 14:27:08+00', 'O como, o quando, e onde as cousas cabem.
');
	VALUES (622, 635, TIMESTAMP WITH TIME ZONE '2020-09-04 19:24:56+00', 'Com nações diferentes se engrandece,
');
	VALUES (622, 632, TIMESTAMP WITH TIME ZONE '2020-09-04 23:14:45+00', 'Do mar, que vê do Sol a roxa entrada.
');
	VALUES (622, 635, TIMESTAMP WITH TIME ZONE '2020-09-05 04:52:16+00', 'Ou quem o Tribo ilustre destruiu
');

	VALUES (623, 645, TIMESTAMP WITH TIME ZONE '2020-03-30 22:51:40+00', '"Vê do Benomotapa o grande império,
');

	VALUES (624, 633, TIMESTAMP WITH TIME ZONE '2020-04-21 14:29:49+00', 'Daquele de quem foi favorecido.
');

	VALUES (625, 634, TIMESTAMP WITH TIME ZONE '2019-08-13 09:29:52+00', 'Mas comer o Gentio não pretende,
');
	VALUES (625, 634, TIMESTAMP WITH TIME ZONE '2019-08-13 10:56:32+00', 'Se nos mostra no ar, robusta e válida,
');
	VALUES (625, 634, TIMESTAMP WITH TIME ZONE '2019-08-13 12:49:16+00', 'O que o ledo Monçaide lhe oferece;
');

	VALUES (626, 634, TIMESTAMP WITH TIME ZONE '2020-04-14 19:40:46+00', 'Engolindo o corrupto mantimento,
');

	VALUES (627, 636, TIMESTAMP WITH TIME ZONE '2018-10-04 15:58:13+00', '"Nestas e outras palavras que diziam
');
	VALUES (627, 691, TIMESTAMP WITH TIME ZONE '2018-10-04 18:23:32+00', 'Chovem sobre nós outros sem medida;
');

	VALUES (628, 636, TIMESTAMP WITH TIME ZONE '2019-01-23 12:56:43+00', 'Vai César, sojugando toda França,
');
	VALUES (628, 636, TIMESTAMP WITH TIME ZONE '2019-01-23 14:33:17+00', 'Ouvir quiseres como se nomeia,
');
	VALUES (628, 663, TIMESTAMP WITH TIME ZONE '2019-01-23 17:01:42+00', 'A clara forma ali estava esculpida
');
	VALUES (628, 636, TIMESTAMP WITH TIME ZONE '2019-01-23 17:38:36+00', 'Que toda a terra é pátria para o forte;
');

	VALUES (629, 694, TIMESTAMP WITH TIME ZONE '2019-05-14 10:53:58+00', 'Que teve o perdido Ítaco em Alcino,
');
	VALUES (629, 694, TIMESTAMP WITH TIME ZONE '2019-05-14 18:33:17+00', 'Dum que primeiro pôs nome à ciência:
');

	VALUES (630, 639, TIMESTAMP WITH TIME ZONE '2019-05-07 00:22:23+00', 'Quando a deixava António por Glafira,
');
	VALUES (630, 640, TIMESTAMP WITH TIME ZONE '2019-05-07 03:10:29+00', 'Cidade nobre e antiga, a quem cercando
');
	VALUES (630, 640, TIMESTAMP WITH TIME ZONE '2019-05-07 03:49:19+00', 'De todo o Oriente, e sublimada
');

	VALUES (631, 657, TIMESTAMP WITH TIME ZONE '2020-11-26 21:41:12+00', 'Todo o valor, primeiro se assinala:
');

	VALUES (632, 640, TIMESTAMP WITH TIME ZONE '2019-10-16 02:47:18+00', 'Onde o Cabo Arsinário o nome perde,
');

	VALUES (633, 640, TIMESTAMP WITH TIME ZONE '2018-11-27 18:29:32+00', '"Com toda üa coxa fora, que em pedaços
');
	VALUES (633, 672, TIMESTAMP WITH TIME ZONE '2018-11-27 20:46:29+00', 'Era esta grão vitória, o Rei subido
');

	VALUES (634, 642, TIMESTAMP WITH TIME ZONE '2019-08-15 22:57:42+00', 'Se para derribar então vieram
');
	VALUES (634, 686, TIMESTAMP WITH TIME ZONE '2019-08-16 03:59:35+00', 'Se alguma traz idónea lá da banda
');

	VALUES (635, 693, TIMESTAMP WITH TIME ZONE '2020-11-10 15:07:00+00', 'Das terras que Fernando e que Rodrigo
');
	VALUES (635, 693, TIMESTAMP WITH TIME ZONE '2020-11-10 19:29:35+00', 'Por que is aventurar ao mar iroso
');

	VALUES (636, 644, TIMESTAMP WITH TIME ZONE '2020-02-17 23:45:36+00', 'Para lá se inclinava a leda frota;
');
	VALUES (636, 668, TIMESTAMP WITH TIME ZONE '2020-02-18 01:16:10+00', 'Que bem mostra estimar o santo dia.
');
	VALUES (636, 644, TIMESTAMP WITH TIME ZONE '2020-02-18 06:36:44+00', 'Vão-a buscar, e mandam adiante,
');
	VALUES (636, 644, TIMESTAMP WITH TIME ZONE '2020-02-18 09:28:07+00', '--"Ó que não sei de nojo como o conte!
');

	VALUES (637, 645, TIMESTAMP WITH TIME ZONE '2019-01-29 10:47:21+00', 'Já que em serviço vai do santo Marte.
');

	VALUES (638, 651, TIMESTAMP WITH TIME ZONE '2020-03-30 03:59:28+00', 'Nas inimigas naus; senti-lo-á o Nilo,
');
	VALUES (638, 646, TIMESTAMP WITH TIME ZONE '2020-03-30 10:59:57+00', 'O Soldão que esse Reino possuía.
');

	VALUES (639, 688, TIMESTAMP WITH TIME ZONE '2020-06-04 02:50:22+00', 'Com este o Reino próspero florece
');
	VALUES (639, 646, TIMESTAMP WITH TIME ZONE '2020-06-04 03:24:11+00', 'Noutro tempo, segundo a antiga fama;
');

	VALUES (640, 647, TIMESTAMP WITH TIME ZONE '2020-04-20 19:08:08+00', 'Muitos com tensão santa eram partidos.
');

	VALUES (641, 647, TIMESTAMP WITH TIME ZONE '2020-04-06 14:15:44+00', 'Rosto, como quem sabe a língua Hispana,
');
	VALUES (641, 647, TIMESTAMP WITH TIME ZONE '2020-04-06 14:24:35+00', 'Nas naus estar se deixa vagaroso,
');
	VALUES (641, 653, TIMESTAMP WITH TIME ZONE '2020-04-06 18:40:01+00', 'Do mar, que vê do Sol a roxa entrada.
');

	VALUES (642, 688, TIMESTAMP WITH TIME ZONE '2020-05-31 06:55:00+00', 'Com forças e poder em que está posto,
');
	VALUES (642, 688, TIMESTAMP WITH TIME ZONE '2020-05-31 11:04:28+00', 'Faria tremular e pôr espanto
');
	VALUES (642, 648, TIMESTAMP WITH TIME ZONE '2020-05-31 19:03:11+00', 'E o bárbaro poder desbaratara
');

	VALUES (643, 655, TIMESTAMP WITH TIME ZONE '2020-01-02 01:03:42+00', 'Do torpe Ismaelita cavaleiro,
');
	VALUES (643, 648, TIMESTAMP WITH TIME ZONE '2020-01-02 08:23:38+00', 'Que lhe dizem que falta resistência
');

	VALUES (644, 661, TIMESTAMP WITH TIME ZONE '2019-06-13 04:41:43+00', 'Que o trabalho do mar, que tanto custa,
');

	VALUES (645, 650, TIMESTAMP WITH TIME ZONE '2020-04-25 20:40:29+00', 'Naufrágios, perdições de toda sorte,
');
	VALUES (645, 650, TIMESTAMP WITH TIME ZONE '2020-04-25 21:53:47+00', 'Que, se não me ajudais, hei grande medo
');

	VALUES (646, 651, TIMESTAMP WITH TIME ZONE '2019-04-20 10:04:13+00', 'Que contra o Céu não val da gente manha;
');
	VALUES (646, 651, TIMESTAMP WITH TIME ZONE '2019-04-20 12:29:29+00', 'Olha Henrique, famoso cavaleiro,
');
	VALUES (646, 651, TIMESTAMP WITH TIME ZONE '2019-04-20 15:38:49+00', 'Que de Cristo lá guarda o santo rito.
');

	VALUES (647, 652, TIMESTAMP WITH TIME ZONE '2021-01-03 17:50:01+00', 'Que sempre se lhe sabe à cabeceira.
');

	VALUES (648, 656, TIMESTAMP WITH TIME ZONE '2019-09-29 21:36:07+00', 'Ora com nova fúria ao céu subia,
');
	VALUES (648, 653, TIMESTAMP WITH TIME ZONE '2019-09-30 05:07:44+00', 'Viemos pôr a última coluna.
');

	VALUES (649, 678, TIMESTAMP WITH TIME ZONE '2019-10-10 09:03:53+00', 'Que o Ibero o viu e o Tejo amedrontados;
');

	VALUES (650, 693, TIMESTAMP WITH TIME ZONE '2020-10-16 07:08:38+00', 'A vós outros aqui se estão guardando.
');
	VALUES (650, 655, TIMESTAMP WITH TIME ZONE '2020-10-16 12:28:11+00', 'O morador de Abila não se escusa,
');
	VALUES (650, 655, TIMESTAMP WITH TIME ZONE '2020-10-16 16:11:30+00', 'De Sião, que estes e outros mais sujeita;
');

	VALUES (651, 663, TIMESTAMP WITH TIME ZONE '2020-02-12 23:13:30+00', 'Aparece, e, segundo ao mar caminha,
');
	VALUES (651, 655, TIMESTAMP WITH TIME ZONE '2020-02-13 00:12:04+00', 'Limpos de todo o falso pensamento.
');
	VALUES (651, 663, TIMESTAMP WITH TIME ZONE '2020-02-13 07:27:55+00', 'Nadando vai e latindo: assim o mancebo
');

	VALUES (652, 656, TIMESTAMP WITH TIME ZONE '2019-11-14 04:01:34+00', 'Que segredos são estes de Natura.
');
	VALUES (652, 656, TIMESTAMP WITH TIME ZONE '2019-11-14 05:51:35+00', 'E que despacho já não esperava
');
	VALUES (652, 669, TIMESTAMP WITH TIME ZONE '2019-11-14 08:02:02+00', 'Para quem de seu Reino abaixa os muros,
');
	VALUES (652, 669, TIMESTAMP WITH TIME ZONE '2019-11-14 13:51:05+00', 'Para subir à pátria verdadeira!
');

	VALUES (653, 657, TIMESTAMP WITH TIME ZONE '2020-11-26 08:38:07+00', 'Dos dois avós as almas cá famosas,
');
	VALUES (653, 657, TIMESTAMP WITH TIME ZONE '2020-11-26 15:38:32+00', 'Como menino da ama castigado,
');
	VALUES (653, 691, TIMESTAMP WITH TIME ZONE '2020-11-26 17:45:46+00', 'Mas ficou duvidoso o vencimento.
');

	VALUES (654, 659, TIMESTAMP WITH TIME ZONE '2021-01-05 15:05:46+00', 'Teu valor alto, o fado quer que venhas
');
	VALUES (654, 660, TIMESTAMP WITH TIME ZONE '2021-01-05 16:23:06+00', 'Vê que os de seus vassalos são notáveis.
');
	VALUES (654, 660, TIMESTAMP WITH TIME ZONE '2021-01-05 18:31:17+00', 'Diante do pai ledo, que a agasalha,
');

	VALUES (655, 659, TIMESTAMP WITH TIME ZONE '2020-11-01 06:20:52+00', 'Outros, por outra parte, vão topar
');
	VALUES (655, 659, TIMESTAMP WITH TIME ZONE '2020-11-01 09:57:59+00', 'Das terras que Fernando e que Rodrigo
');
	VALUES (655, 681, TIMESTAMP WITH TIME ZONE '2020-11-01 12:14:54+00', 'E mais sendo afirmados pelos Mouros,
');
	VALUES (655, 659, TIMESTAMP WITH TIME ZONE '2020-11-01 14:47:39+00', 'Aqueles, cujos golpes já provasses.
');

	VALUES (656, 675, TIMESTAMP WITH TIME ZONE '2021-01-26 18:09:52+00', 'A muda poesia ali descreve
');
	VALUES (656, 660, TIMESTAMP WITH TIME ZONE '2021-01-26 20:03:43+00', 'Descobri-la-á a primeira vossa frota.
');
	VALUES (656, 660, TIMESTAMP WITH TIME ZONE '2021-01-26 20:57:54+00', 'Das naus o falso Mouro despedido,
');

	VALUES (657, 661, TIMESTAMP WITH TIME ZONE '2020-01-28 22:14:40+00', 'Aqui tens com quem podes consolar-te!
');
	VALUES (657, 661, TIMESTAMP WITH TIME ZONE '2020-01-29 02:05:32+00', 'Com ele posta em campo já se via;
');
	VALUES (657, 665, TIMESTAMP WITH TIME ZONE '2020-01-29 03:06:11+00', 'Os raios que no mundo resplandecem,
');
	VALUES (657, 665, TIMESTAMP WITH TIME ZONE '2020-01-29 08:55:39+00', 'Que as horas vai do dia distinguindo,
');

	VALUES (658, 672, TIMESTAMP WITH TIME ZONE '2019-06-11 23:05:49+00', 'Pelas concavidades retumbando.
');
	VALUES (658, 661, TIMESTAMP WITH TIME ZONE '2019-06-12 05:23:44+00', 'Pois que direi daqueles que em delícias,
');
	VALUES (658, 672, TIMESTAMP WITH TIME ZONE '2019-06-12 07:41:14+00', 'Foi nos áridos campos (assoprando
');
	VALUES (658, 672, TIMESTAMP WITH TIME ZONE '2019-06-12 08:34:51+00', 'Dos seus, correndo acode à primeira ala:
');

	VALUES (659, 696, TIMESTAMP WITH TIME ZONE '2018-12-21 20:43:39+00', 'O Reino de Plutão horrendo e escuro.
');
	VALUES (659, 663, TIMESTAMP WITH TIME ZONE '2018-12-22 04:39:38+00', 'E depois que ao Rei apresentaram,
');

	VALUES (660, 664, TIMESTAMP WITH TIME ZONE '2021-03-22 20:21:31+00', 'Em vendo o mensageiro, com jocundo
');
	VALUES (660, 684, TIMESTAMP WITH TIME ZONE '2021-03-23 00:10:02+00', 'Egas estava a tudo oferecido.
');
	VALUES (660, 684, TIMESTAMP WITH TIME ZONE '2021-03-23 04:05:43+00', 'Fugir-me, por que não possa tocar-te,
');
	VALUES (660, 664, TIMESTAMP WITH TIME ZONE '2021-03-23 06:36:32+00', 'Em consonância igual, os instumentos
');

	VALUES (661, 673, TIMESTAMP WITH TIME ZONE '2021-04-03 20:28:16+00', 'Para adquirir os povos, tão fingidas,
');
	VALUES (661, 664, TIMESTAMP WITH TIME ZONE '2021-04-03 22:47:06+00', 'O Mestre morre ali de Santiago,
');
	VALUES (661, 664, TIMESTAMP WITH TIME ZONE '2021-04-04 05:21:27+00', 'Das terras e do mar a redondeza;
');

	VALUES (662, 665, TIMESTAMP WITH TIME ZONE '2019-12-26 22:58:05+00', 'Do sumo sacerdócio a dignidade,
');
	VALUES (662, 665, TIMESTAMP WITH TIME ZONE '2019-12-27 04:56:12+00', 'Até render-se a ele ou logo à morte.
');

	VALUES (663, 689, TIMESTAMP WITH TIME ZONE '2020-04-23 23:57:41+00', 'A cerviz sua ao jugo, o ferro e ira
');
	VALUES (663, 689, TIMESTAMP WITH TIME ZONE '2020-04-24 02:59:14+00', 'Árduo, difícil, duro a humano trato.
');

	VALUES (664, 666, TIMESTAMP WITH TIME ZONE '2018-10-15 03:15:03+00', 'Agora o mar, depois o fresco rio.
');
	VALUES (664, 692, TIMESTAMP WITH TIME ZONE '2018-10-15 03:35:41+00', 'Para onde Alcides pôs a extrema meta.
');
	VALUES (664, 666, TIMESTAMP WITH TIME ZONE '2018-10-15 03:40:33+00', 'Deram os vencedores aos vencidos,
');

	VALUES (665, 666, TIMESTAMP WITH TIME ZONE '2019-03-08 20:01:53+00', 'Fortes, de quatrocentos Castelhanos,
');

	VALUES (666, 667, TIMESTAMP WITH TIME ZONE '2019-11-09 01:14:18+00', 'Dos fados as entranhas revolvendo,
');

	VALUES (667, 689, TIMESTAMP WITH TIME ZONE '2020-05-15 23:56:23+00', 'Obras, que o forte braço já fizera:
');

	VALUES (668, 677, TIMESTAMP WITH TIME ZONE '2020-08-14 00:58:21+00', 'Tu só de mi só foges na espessura?
');
	VALUES (668, 677, TIMESTAMP WITH TIME ZONE '2020-08-14 01:02:00+00', 'Do enganoso ardil, que o Mouro urdia,
');
	VALUES (668, 677, TIMESTAMP WITH TIME ZONE '2020-08-14 07:05:14+00', 'Vos é saberdes os futuros feitos
');

	VALUES (669, 673, TIMESTAMP WITH TIME ZONE '2019-09-14 03:37:08+00', 'Todos de grande esforço; e assim parece
');

	VALUES (670, 673, TIMESTAMP WITH TIME ZONE '2020-11-22 08:18:53+00', 'Encosta-se no chão, que está caindo,
');
	VALUES (670, 673, TIMESTAMP WITH TIME ZONE '2020-11-22 09:56:53+00', 'Uma vontade má de pensamento.
');
	VALUES (670, 673, TIMESTAMP WITH TIME ZONE '2020-11-22 13:24:44+00', 'Ali estão das deidades as figuras
');

	VALUES (671, 675, TIMESTAMP WITH TIME ZONE '2019-11-23 04:19:22+00', 'Ou quem viu em fortuna haver firmeza?
');
	VALUES (671, 687, TIMESTAMP WITH TIME ZONE '2019-11-23 08:19:43+00', 'Da Madre, que nos céus está em essência;
');
	VALUES (671, 675, TIMESTAMP WITH TIME ZONE '2019-11-23 10:04:11+00', 'E estes sejam os doze de Inglaterra.
');
	VALUES (671, 675, TIMESTAMP WITH TIME ZONE '2019-11-23 16:04:48+00', 'Que outrem cometa a fúria de Nereu.
');

	VALUES (672, 695, TIMESTAMP WITH TIME ZONE '2019-03-03 10:51:12+00', 'Cidade já por trato nobre e rica.
');
	VALUES (672, 675, TIMESTAMP WITH TIME ZONE '2019-03-03 12:36:57+00', 'Outro Joane, invicto cavaleiro,
');
	VALUES (672, 695, TIMESTAMP WITH TIME ZONE '2019-03-03 12:40:43+00', 'Porém nem tudo esconde, nem descobre,
');
	VALUES (672, 675, TIMESTAMP WITH TIME ZONE '2019-03-03 17:27:10+00', 'A branca e viva cor, coa doce vida.
');

	VALUES (673, 692, TIMESTAMP WITH TIME ZONE '2020-03-06 12:12:00+00', 'Já de Castela o Rei desbaratado
');
	VALUES (673, 692, TIMESTAMP WITH TIME ZONE '2020-03-06 17:04:24+00', 'Mais descobrimos do que humano espírito
');
	VALUES (673, 676, TIMESTAMP WITH TIME ZONE '2020-03-06 17:42:03+00', 'Por Afonso alto Rei de Portugal."
');

	VALUES (674, 677, TIMESTAMP WITH TIME ZONE '2019-10-26 12:14:38+00', 'O mar todo com fogo e ferro ferve,
');

	VALUES (675, 693, TIMESTAMP WITH TIME ZONE '2020-10-26 04:43:25+00', 'Foi pelos fortes Reis desbaratado,
');
	VALUES (675, 693, TIMESTAMP WITH TIME ZONE '2020-10-26 04:51:44+00', 'Tal Joane, com outros escolhidos
');
	VALUES (675, 693, TIMESTAMP WITH TIME ZONE '2020-10-26 06:40:43+00', 'Permissão e vingança foi celeste,
');
	VALUES (675, 678, TIMESTAMP WITH TIME ZONE '2020-10-26 13:29:32+00', 'Que viva e povoador seja de Frandes.
');

	VALUES (676, 695, TIMESTAMP WITH TIME ZONE '2019-03-26 11:04:48+00', 'Então verás o dom soberbo e rico,
');
	VALUES (676, 679, TIMESTAMP WITH TIME ZONE '2019-03-26 15:18:46+00', 'Nos braços do salgado e curvo rio
');
	VALUES (676, 695, TIMESTAMP WITH TIME ZONE '2019-03-26 20:23:21+00', 'Que a coroa da palma ali coroa.
');

	VALUES (677, 681, TIMESTAMP WITH TIME ZONE '2020-11-16 04:36:25+00', 'Os cornos ajuntou da ebúrnea lua
');

	VALUES (678, 686, TIMESTAMP WITH TIME ZONE '2020-11-17 09:08:26+00', 'Imitar os ilustres e igualá-los:
');

	VALUES (679, 690, TIMESTAMP WITH TIME ZONE '2020-08-28 20:35:36+00', 'Vê que do lago donde se derrama
');

	VALUES (680, 691, TIMESTAMP WITH TIME ZONE '2019-09-24 06:47:59+00', 'Ó fraudulento gosto, que se atiça
');
	VALUES (680, 691, TIMESTAMP WITH TIME ZONE '2019-09-24 12:55:09+00', 'Para quem tem de amor experiência;
');
	VALUES (680, 691, TIMESTAMP WITH TIME ZONE '2019-09-24 15:09:43+00', 'Se fantásticas são, se verdadeiras."
');

	VALUES (681, 695, TIMESTAMP WITH TIME ZONE '2019-09-13 14:47:01+00', 'Dai-me uma fúria grande e sonorosa,
');

	VALUES (682, 692, TIMESTAMP WITH TIME ZONE '2020-05-08 20:46:10+00', 'De soldados não fora Lusitano,
');

	VALUES (683, 690, TIMESTAMP WITH TIME ZONE '2020-10-09 21:17:28+00', 'Começo-lhe a mostrar da rica pelo
');
	VALUES (683, 688, TIMESTAMP WITH TIME ZONE '2020-10-10 03:21:10+00', 'No Santo dá, já a tudo oferecido;
');

	VALUES (684, 690, TIMESTAMP WITH TIME ZONE '2020-08-24 23:31:57+00', 'Que também dela hão medo os Elementos!
');
	VALUES (684, 690, TIMESTAMP WITH TIME ZONE '2020-08-25 06:35:02+00', 'Ora pega na orelha, ora no lado,
');
	VALUES (684, 689, TIMESTAMP WITH TIME ZONE '2020-08-25 13:35:59+00', 'Que só por tua altíssima bondade,
');

	VALUES (685, 694, TIMESTAMP WITH TIME ZONE '2020-05-15 19:46:36+00', 'As nossas, o seu mar se corta e fende;
');

	VALUES (686, 690, TIMESTAMP WITH TIME ZONE '2020-09-23 00:26:22+00', 'Que eles sós poderiam, se não erro,
');
	VALUES (686, 690, TIMESTAMP WITH TIME ZONE '2020-09-23 03:29:13+00', 'E por trabalhos vãos nunca repousas,
');
	VALUES (686, 695, TIMESTAMP WITH TIME ZONE '2020-09-23 07:19:28+00', 'Água das fontes, doce e cristalina;
');

	VALUES (687, 693, TIMESTAMP WITH TIME ZONE '2020-11-01 21:10:42+00', 'Confessar-me a verdade limpa e nua,
');
	VALUES (687, 693, TIMESTAMP WITH TIME ZONE '2020-11-02 04:46:23+00', 'Quem do oportuno tempo se aproveita."
');
	VALUES (687, 693, TIMESTAMP WITH TIME ZONE '2020-11-02 06:08:37+00', 'A tento nela os olhos apascenta.
');
	VALUES (687, 693, TIMESTAMP WITH TIME ZONE '2020-11-02 11:19:32+00', 'De Cananor, com pouca força e gente;
');

	VALUES (688, 692, TIMESTAMP WITH TIME ZONE '2018-07-16 08:27:00+00', 'Porém dizem-lhe todos, que tem perto
');
	VALUES (688, 696, TIMESTAMP WITH TIME ZONE '2018-07-16 12:41:03+00', 'Neles ousadamente se subissem;
');
	VALUES (688, 692, TIMESTAMP WITH TIME ZONE '2018-07-16 18:05:51+00', 'Que esses chorosos olhos soberanos;
');

	VALUES (689, 692, TIMESTAMP WITH TIME ZONE '2018-09-12 11:13:42+00', 'Fazem os bombardeiros seu ofício,
');
	VALUES (689, 694, TIMESTAMP WITH TIME ZONE '2018-09-12 18:51:00+00', 'Vede-lo em feias guerras ocupado,
');

